/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `archive_student_` (
  `student_id` bigint(20) unsigned NOT NULL COMMENT '档案学生学号',
  `teacher_id` varchar(13) NOT NULL COMMENT '档案教师用户名',
  `sex` varchar(2) DEFAULT NULL COMMENT '档案学生性别',
  `name` varchar(15) DEFAULT NULL COMMENT '档案学生姓名',
  `major` varchar(10) DEFAULT NULL COMMENT '建档学生专业',
  `grade` smallint(5) unsigned DEFAULT NULL COMMENT '档案学生年级',
  `student_class` int(10) unsigned DEFAULT NULL COMMENT '档案学生班级',
  `ethnic_group` varchar(5) DEFAULT NULL COMMENT '档案学生民族',
  `duty` varchar(20) DEFAULT NULL COMMENT '档案学生职务',
  `dormitory` varchar(15) DEFAULT NULL COMMENT '档案学生宿舍',
  `birth_origin` varchar(10) DEFAULT NULL COMMENT '档案学生生源地',
  `family_address` varchar(30) DEFAULT NULL COMMENT '档案学生家庭住址',
  `contact_way` varchar(14) DEFAULT NULL COMMENT '档案学生联系方式',
  `family_tel_number` varchar(14) DEFAULT NULL COMMENT '档案学生家庭电话',
  `father_tel_number` varchar(14) DEFAULT NULL COMMENT '档案学生父亲电话',
  `mother_tel_number` varchar(14) DEFAULT NULL COMMENT '档案学生母亲电话',
  `family_condition` varchar(300) DEFAULT NULL COMMENT '档案学生家庭情况',
  `study_condition` varchar(300) DEFAULT NULL COMMENT '档案学生学习情况',
  `health_condition` varchar(300) DEFAULT NULL COMMENT '档案学生身心情况',
  `life_condition` varchar(300) DEFAULT NULL COMMENT '档案学生生活情况',
  `other_condition` varchar(300) DEFAULT NULL COMMENT '档案其他情况',
  `buliding_basis` varchar(1000) DEFAULT NULL COMMENT '建档依据',
  `buliding_recorder` varchar(15) DEFAULT NULL COMMENT '建档记录人',
  `buliding_time` date DEFAULT NULL COMMENT '建档时间',
  `destorying_basis` varchar(1000) DEFAULT NULL COMMENT '除档依据',
  `destorying_recorder` varchar(15) DEFAULT NULL COMMENT '除档记录人',
  `destorying_time` date DEFAULT NULL COMMENT '除档时间',
  `buliding_person` varchar(15) DEFAULT NULL COMMENT '建档人',
  `buliding_person_duty` varchar(15) DEFAULT NULL COMMENT '建档人职务',
  `help_type` varchar(15) DEFAULT NULL COMMENT '帮扶类型',
  `attention_type` varchar(4) DEFAULT NULL COMMENT '关注状态',
  `last_record_time` date DEFAULT NULL COMMENT '该学生末次记录时间',
  `political_status` varchar(6) DEFAULT NULL COMMENT '档案学生政治面貌',
  `archive_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`archive_id`),
  UNIQUE KEY `student_id` (`student_id`),
  KEY `idx_name` (`name`),
  KEY `idx_grade` (`grade`),
  KEY `idx_student_class` (`student_class`),
  KEY `idx_sex` (`sex`),
  KEY `idx_major` (`major`),
  KEY `idx_ethnic_group` (`ethnic_group`),
  KEY `idx_help_type` (`help_type`),
  KEY `idx_attention_type` (`attention_type`)
) ENGINE=InnoDB AUTO_INCREMENT=102 DEFAULT CHARSET=utf8 COMMENT='帮扶建档学生信息表';
