江医学院的教师','期中考试，C语言和微积分两科均取得高分。四级模拟考试有一半都是过了的。','该生对自身要求要，学习倍感压力，适应较差。该生遇到困难采取忍者，自我承受的应对，不利于问题与情绪的缓解','','','心理中心给的反馈',NULL,'2018-01-03',NULL,NULL,NULL,'齐翔','辅导员','情绪问题','重点关注','2018-01-10','团员',64),(2017221302004,'qixiang','男','蓝浩诚','',2017,2017221302,'壮','无','QB20-321','广西','广西钦州市财苑一巷16号','18777733494','','','13737778993','十多年积累的家庭问题，父母决裂，对簿公堂，站在母亲一边，对亲戚极度失望，影响到该同学人生观和价值观。该同学表现得成熟老练，但自觉三观不正，对恋爱情感等都很麻木','','','','','',NULL,'2018-01-03',NULL,NULL,NULL,'齐翔','辅导员','家庭问题','定期关心','2018-01-03','团员',65),(2017221301011,'qixiang','男','刘忠齐','',2017,2017221302,'藏','无','QB20-316','四川','四川省西昌市月华乡红旗村五组','15882279668','','15183403982','13737778993','','','该生一直存在胃肠问题，身体瘦弱，自我管理能力低，承受压力能力差。重点关注，从生活学习等方面关注，同时注意其羸弱的体质，身体的虚弱增强该生的抑郁感受。','','','','','2018-01-03',NULL,NULL,NULL,'齐翔','辅导员','学业压力','重点关注','2018-01-10','团员',66),(2017221005003,'qixiang','男','李宇航','',2017,2017221005,'汉','无','','','','','','','','','','','','','',NULL,'2018-01-03',NULL,NULL,NULL,'齐翔','辅导员','','一般关注',NULL,'团员',69),(2017221002015,'qixiang','男','陈浩','',2017,2017221002,'汉','无','QB20-313','四川','四川省泸州市泸县得胜镇顺民村四组120号','13698151142','','13698151142','13198860131','','','测试时刚好失恋，状态不好，当时无心学习，所以半期考试差，现在不知道如何补上来','','','',NULL,'2018-01-03',NULL,NULL,NULL,'齐翔','辅导员','学业压力 情绪问题','重点关注',NULL,'团员',70),(2017221302020,'qixiang','男','谯凯','',2017,2017221302,'汉','无','QB20-323','四川','四川省南充市高坪区龙门镇谯家坟村5组13号','13208168895','','13829720992','18113934028','父亲广东市惠州市汇力餐饮管理服务有限公司 管理，母亲广东市惠州市汇力餐饮管理服务有限公司，家里还有个姐姐。','','抑郁情绪明显，有酗酒的情况，情绪不稳定，以前有慢性胃病，现在好多了。家庭关系一般，与父母关系疏远，有事也不愿意谈。','','','','','2018-01-03',NULL,NULL,NULL,'齐翔','辅导员','学业压力 情绪问题','重点关注','2018-01-10','团员',71),(2017221303004,'qixiang','男','于国嘉','',2017,2017221303,'汉','无','QB20-333','河北','河北省保定市瑞祥大街111号','15830298931','','','17732280172','','','该生从初中开始感到克制不住和别人比较，对别人嫉妒，初中很长一段时间整晚睡不着。感到自己因为只顾学习，没有办法处理人际关系。人际支持不够。没有好朋友，父母半个月联系一次。','','','',NULL,'2018-01-03',NULL,NULL,NULL,'齐翔','辅导员','人际交往 情绪问题','定期关注','2018-01-03','团员',72),(2017221005006,'qixiang','男','刘济宁','',2017,2017221005,'汉','班长','QB20-333','吉林','吉林省吉林市昌邑区通潭西十四区3-4-38号','13596355919','','13704407916','','','学生总体情况适应，有些迷茫，感到专业兴趣不大，只想维持学习不落后的情况，但是不知如何与周围学习很努力的环境匹配。','','','','',NULL,'2018-01-03',NULL,NULL,NULL,'齐翔','辅导员','情绪问题','定期关注','2018-01-03','团员',73),(2017221005020,'qixiang','男','张舒逸','',2017,2017221005,'彝','无','QB20-226','四川','四川省凉山州会理县城关镇县府街39号4栋2单元3号','18981522756','','13518421268','13981579576','基本适应，自述高二时经常与父亲吵架，后来缓解，刚入大学有些焦虑，晚睡经常玩手机。','','有一些焦虑和抑郁情绪','','','',NULL,'2018-01-03',NULL,NULL,NULL,'齐翔','辅导员','情绪问题','定期关注',NULL,'团员',74),(2017221005011,'qixiang','男','叶臻屹','',2017,2017221005,'汉','无','QB20-228','四川','天府二街766华润凤凰城3-1-801','18980980361','','13981943335','','','','有些抑郁情绪，人际交往困扰','总体适应大学生活，有些抑郁情绪。自己感觉最大的困扰是没有亲密的朋友。人际支持不够。','','',NULL,'2018-01-03',NULL,NULL,NULL,'齐翔','辅导员','情绪问题 人际交往','定期关注','2018-01-03','团员',75),(2017221201010,'yangyanxiang','','萧耀伦','',2017,2017221201,'','-','QB20-421','','广东省东莞市常平镇木棆长岭75号','13729906183','','','','父亲为高中英语教师，母亲为工人','大一上学期期中考试成绩微积分75线代87，学生本人对成绩不满意','入学前检查为精神分裂，期中考试后精神状态变化明显，在吃药。','生活作息较为规律。','心理中心反馈高危，重点关注。','学生反馈有自杀想法，入学前被诊断为精神分裂。',NULL,'2018-01-09',NULL,NULL,NULL,'杨彦祥','辅导员','心理困难','重点关注','2018-01-09','共青团员',77),(2017221004010,'qixiang','男','邹永赫','',2017,2017221004,'汉','无','QB20-601','陕西','陕西省咸阳市渭城区愿景园小区九号楼1单元1002','15108469567','','13309105850','15229701183','','平时不爱学习，基本上待在宿舍，下课后没有花时间在学习上。','','','','第一学期期末考试微积分缺考，原因是不想考试','','2018-01-10',NULL,NULL,NULL,'齐翔','辅导员','学业困难','一般关注','2018-01-09','团员',78),(2014220902013,'zhangshihan','男','于宗民','',2014,902,'汉','','欣6-622','北京','','13032869502','','13911156676','15101578326','家庭条件较为优越，与母亲关系较好，母亲关注很多。','挂科，对学习不太上心，曾被学业警示和提醒，但为了“不给自己找麻烦”，能够将补考或重修修过。但大三后对学习兴趣愈发淡薄。对自己感兴趣的虚拟现实等方面比较投入。','身体健康，但思绪很多，关注哲学，不喜欢和其他人交流，感觉其他人听不懂，在心理上姿态较高，不容易袒露心声，大三下回家去做心理咨询，并表示要休学，与家人沟通后发现并没有带到医院去做诊断，咨询也只做了两次。','与他人能够正常交流，同学关系正常。寝室被自己改造，常年宅在寝室。','','',NULL,'2018-01-10',NULL,NULL,NULL,'张诗晗','辅导员','心理问题','一般关注','2018-01-11','',79),(2016220401017,'dairuiting','男','王棋','',2016,2016221201,'','','','','','','','','','','','','','','',NULL,'2018-01-10',NULL,NULL,NULL,'戴瑞婷','辅导员','心理困难','一般关注','2018-01-10','',80),(2014220105010,'zhangshihan','男','董帅志','',2014,105,'汉','','17-209','四川成都','河北省廊坊市文安县','13402877975','','13785636887','13784797506','家庭关系稍微有些紧张，母亲对孩子关注多，但不得其法。高中时期因为学生女朋友事情家长和学生出现过隔阂，现在学生不喜欢接家长电话，平时联系也很少。','挂科多，学分差的多，学生想要继续考研。现在给他的建议是延期毕业。','身体健康，但对学业和家庭关系有压力','前女友高中就在一起，保研，两人分手。现在董帅志找了个护士女朋友，大四岁，一起在外住。女朋友想要结婚，学生不想，平时房租是谁有钱谁交。女生知道学生的学业问题，也督促他好好学习。','','',NULL,'2018-01-10',NULL,NULL,NULL,'张诗晗','辅导员','学业问题','一般关注','2018-01-19','',81),(2017221201017,'yangyanxiang','','吴京城','',2017,2017221201,'','班长','QB20-425','','成都市郫都区红光镇广场路北一段387号','18380818083','','13541136288','','父亲普通工人，母亲无业。','学习期望值较高，学习压力较大','身体健康，心理压力较大','有抽烟行为','有过自杀经历、咨询经历、服药经历','心理中心反馈、学生状态了解','','2018-01-11',NULL,NULL,NULL,'杨彦祥','辅导员','心理困难','重点关注','2018-01-11','共青团员',82),(2017220303001,'wangyanyan','男','俞杰','',2017,2017220303,'汉','无','QB20-611','四川德阳','四川省德阳市旌阳区龙泉山北路98号','15181087941','','13990201231','13881099249','爸妈在云南出差，过年才回家，(妈妈在初中的时候就去云南了，爸爸在学生高三毕业后也去了云南)，目前学生跟着舅舅一起生活。父母平均一个月跟他联系一次，学生不会主动跟父母联系，有什么事也不喜欢告诉父母，认为父母离开自己是去追求他们的自由和想要的生活了，平时不会想念父母，父母的优先级最低。','认为大学跟高中差不多，习惯就好，该学习就学习，没有太大的学习压力。','学生认为活着没有太大的意思，只是时间在推着自己往前走，但是又怕死。他对万事万物报有一颗平常心，顺其自然，好心情和坏心情对他来说没什么区别，而且心情不好的时候，学生说他会自己去调节，然后很快走出来，没有什么他想不通的问题。','喜欢独处，不喜欢群体活动和群体生活。不适应宿舍生活，感觉跟室友一块生活很不舒服。','学生谈到他从小学开始就有这么一种情况：站在高处往下望会想跳下去，手里拿刀的时候会想伤害自己，但是他又能克制住自己，而且主动的避免把自己放在类似的环境中，他说到他怕死，然后一直都在让自己远离危险，比如尽量不从高往低看，尽量不拿刀子等。并且认为既然从小学就有这些类似的感觉，而自己到现在都好好的，说明没什么问题。','心理障碍','','2018-01-12',NULL,NULL,NULL,'王艳艳','辅导员','心理问题','重点关注','2018-01-15','共青团员',83),(2016220105027,'qixiang','男','文梵','',2017,2017221005,'汉','团员','QB20-604','重庆','重庆市九龙坡区珠江花园怡景阁11-1','13568942544','','13983077896','15923368836','父亲在中铁八局一公司上班，妈妈无工作，自由职业','','性格开朗，愿意和别人交流。但是自己内心比较焦虑','','','',NULL,'2018-01-12',NULL,NULL,NULL,'齐翔','辅导员','心理问题 学业困难','重点关注','2018-01-18','团员',85),(2014220104022,'zhangshihan','男','简立','',2014,20104022,'汉','','','','重庆市合川区丽景水岸1-25-8','18523976404','','13928249711','13637714605','父母都是农民工，平时和姐姐沟通较多，但是自从姐姐生孩子，沟通也少了许多，家人对其关心明显不够，学生属于留守儿童。','生在高一下开始惰性强，每天都玩游戏，感觉无目标。失眠厉害，伴随头痛，曾经在家人的陪同下多次到医院精神科检查，学生表示吃药无效果。到学校心理咨询中心咨询过，去了一次便不去。不喜欢与人交流，父母对其关心程度较差，多是学生姐姐打理学生的生活。缺课严重，挂科。','\n高中开始失眠严重，打游戏成瘾，对警察、教师等权威人士具有逆反心理，对未来规划不明确。','长期在寝室，不善交际，生活黑白颠倒。','','','','2018-01-12',NULL,NULL,NULL,'张诗晗','辅导员','心理问题','重点关注','2018-01-12','',86),(2015220402033,'yangyanxiang','女','刘相佚','',2017,2017221201,'','-','QB02-120','','合川区南津街999号1\n2-1-2-1','13627687875','','13983055303','13635422720','父母均为电力公司职工','学习成绩良好','焦虑情况明显，身体健康','生活作息规律，偶尔失眠','学生母亲给学生在医院开了药，目前正在吃药','休学复学后学生状态不好','','2018-01-15',NULL,NULL,NULL,'杨彦祥','辅导员','心理困难','重点关注','2018-01-15','共青团团',87),(2014220402032,'honglei','男','江宸','',2014,2014220402,'汉族','学生','新村6栋422','四川省攀枝花市','四川省攀枝花市加州花园','13402886220','','','13388313788','父亲工程师，母亲小学教师\n生下来不久由外公外婆带带3岁半，然后上幼儿园后和父母一起\n\n其他情况中 重大事件续\n5、母亲描述：孩子在幼儿园小学阶段对孩子过于强势，之后在青春期又对孩子过于迁就，有时候基本妥协到对孩子无原则，有时候江宸发怒，还会打母亲的头，母亲只能含泪隐忍6、最近江宸和母亲沟通中说“自己又复发了，那种感觉又上来了”母亲问上一次是什么时间，他回答：高二高三。母亲问那你怎么度过的？他回答：忘记了。7、江宸拒绝，也比较反感母亲向他表达爱他的感情。','基本能完成学业，报名了研究生入学考试，却没有参加考试。','自从2017年9月份，接手该班级，班长杨林彬就要我重点关注该生。','作息时间不规律，吃饭基本叫外卖，喝水都是矿泉水可乐，身体状态看上去很差，脸色苍白。不理发，不洗头，不剪指甲，外表看上去很邋遢','母亲也意识孩子存在的心理问题，讲述了小时候的几件对江宸影响重大的事件：1、3岁多的美术课，被老师请起来发言，突然失语，过后的三天都不会讲话了。2、去学游泳，一直发抖，游泳教练感觉孩子过于紧张，从而终止。3、不太喜欢和小朋友玩耍，喜欢躲在邻居家看书，直到现在在寝室也有蹲在桌子下看书的习惯。4、小学5年级和父母去海南旅游，由于好奇去天涯海角大石头背后看海浪，母亲因为找不到孩子着急，当孩子看够了从石头背后走出来，着急的母亲在公众场合打了孩子，从此孩子不再喜欢和父母旅游。5-7见家庭情况','抑郁症','','2018-01-15',NULL,NULL,NULL,'洪磊','科长','心理','一般关注','2018-01-18','共青团员',92),(2014220902021,'zhangshihan','男','颜铭','',2014,2014220902,'','','','','广东省东莞市石碣镇同富西路盈翠曦园2栋2单元','15528169691','','0769 86380392','0769 86380392','家庭情况尚可。学生说母亲容易操心。父亲是医生。初中开始，父亲过于关注成绩，缺乏关心。学生在初中时就已经有了抑郁的苗头，但是不严重，可控。家里有个小五岁的妹妹，学生想成为她的榜样。','大二时候就去了英国伯恩茅斯参加项目。在英国检查出抑郁。2018年检查出重度抑郁，正在加倍服药。现在在伯恩茅斯挂科几门，正在重修。所在英国媒体交流学院，专业方向只有7个人，学生很喜欢该专业。','重度抑郁。','缺乏朋友，不够主动，但是不拒绝关心。在英国和4位英国的同学住在一起。','现在仍然在英国，对其观察只能局限于QQ、微信、电话。','','','2018-01-17',NULL,NULL,NULL,'张诗晗','辅导员','心理问题','重点关注','2018-01-19','',93),(2016220101002,'test',NULL,'吴宗培',NULL,2016,2016220101,NULL,'-','XY02-302',NULL,'广东省东莞市石龙聚豪华庭星雨阁5楼b栋','18988721189',NULL,NULL,NULL,'','','','','','',NULL,'2018-01-18',NULL,NULL,NULL,'测试','测试','学业困难 家庭困难','一般关注','2018-01-21','共青团员',99),(2016220104001,'test',NULL,'巩傲凡',NULL,2016,2016220104,NULL,'-','XY02-427',NULL,'江苏省徐州市睢宁县睢城镇人民东路101-19号','15250909797',NULL,NULL,NULL,'','','','','','',NULL,'2018-01-18',NULL,NULL,NULL,'测试','测试','-','一般关注','2018-01-18','共青团员',100);
