  `photo_url` varchar(80) DEFAULT NULL COMMENT '学生照片url',
  `duty` varchar(40) DEFAULT NULL COMMENT '学生职务',
  `dormitory` varchar(50) DEFAULT NULL,
  `contact_way` varchar(28) DEFAULT NULL COMMENT '学生联系方式',
  `id_card_number` varchar(36) DEFAULT NULL COMMENT '学生身份证号码',
  `qq_number` bigint(20) unsigned DEFAULT NULL COMMENT '学生QQ号码',
  `email` varchar(32) DEFAULT NULL COMMENT '学生邮箱地址',
  `birthday` date DEFAULT NULL COMMENT '学生生日',
