  `family_address` varchar(80) DEFAULT NULL COMMENT '学生家庭详细地址',
  `family_tel_number` varchar(56) DEFAULT NULL COMMENT '学生家庭电话',
  `postcode` varchar(48) DEFAULT NULL,
  `specialty` varchar(150) DEFAULT NULL,
  `duty_in_high_school` varchar(200) DEFAULT NULL,
  `award_in_high_school` varchar(1000) DEFAULT NULL,
  `is_had_technology_competition_award` varchar(150) DEFAULT NULL COMMENT '学生是否有科技竞赛类获奖',
  `father_name` varchar(24) DEFAULT NULL COMMENT '学生父亲姓名',
  `father_work_unit` varchar(40) DEFAULT NULL COMMENT '学生父亲工作单位',
  `father_work_unit_address` varchar(60) DEFAULT NULL COMMENT '学生父亲工作单位详细地址',
  `father_duty` varchar(40) DEFAULT NULL COMMENT '学生父亲职务',
  `father_postcode` varchar(100) DEFAULT NULL,
  `father_tel_number` varchar(36) DEFAULT NULL COMMENT '学生父亲电话',
  `mother_name` varchar(24) DEFAULT NULL COMMENT '学生母亲姓名',
  `mother_work_unit` varchar(40) DEFAULT NULL COMMENT '学生母亲工作单位',
  `mother_work_unit_address` varchar(60) DEFAULT NULL COMMENT '学生母亲工作单位详细地址',
  `mother_duty` varchar(40) DEFAULT NULL COMMENT '学生母亲职务',
  `mother_postcode` varchar(100) DEFAULT NULL,
  `mother_tel_number` varchar(36) DEFAULT NULL COMMENT '学生母亲电话',
  `study_condition` varchar(10) DEFAULT '在读（在校）' COMMENT '学生学业状态',
  PRIMARY KEY (`student_id`),
  KEY `idx_name` (`name`),
  KEY `idx_grade` (`grade`),
  KEY `idx_student_class` (`student_class`),
  KEY `idx_sex` (`sex`),
  KEY `idx_duty` (`duty`),
  KEY `idx_major` (`major`),
  KEY `idx_political_status` (`political_status`),
  KEY `idx_ethnic_group` (`ethnic_group`),
  KEY `idx_birth_origin` (`birth_origin`),
  KEY `idx_province` (`province`),
  KEY `idx_city` (`city`),
  KEY `idx_father_name` (`father_name`),
  KEY `idx_mother_name` (`mother_name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='学生基本信息表';
