INSERT INTO `record_` VALUES (117,2016220305033,'周联系简易记录表','2017-12-07','办公室','','戴瑞婷','','面谈','该生早上和妈妈一起来办公室。该生还是表示本学期课程没有办法听得懂，所以打算在考试之前，能够降级。但是由于大一上的课程全部都通过了，所以来寻求一个合适的方法。该生和该生的家长都想在本学期能够参加本学期的期末考试，在期末考试结束以后在降级，询问教务科谢老师后，谢老师说，在考试周是不能进行降级的，但考虑到该生的特殊情况。现在这样子，意义不是很大，不能参加本学期的考试，所以打算先考几门考试，该生也表示本学期的考试后基本肯定能够达到九分，只要达到35分，学分不会面临退学，所以他想先考几门课程，然后再选择降级。回大一年级重新学习，好好学习，争取能够跟得上课程的进度。',''),(120,2016220305033,'家长联系记录表','2017-12-04','','王猛','戴瑞婷','','面谈','从同学那里了解到该生在本学期上课时仍然有玩手机游戏的现象。并且课程考试没有得到理想的成绩，上课签到也又没有去的情况，而且。平时作业也有没交的情况。因此也比较严重早上打电话给他妈妈讲了他最近的具体情况，因为考试成绩刚刚出。该生的考试成绩并不是很理想。因此，建议家长和我一起在近段时间多关注学生的动态，以及心理情况。家长表示愿意配合家长也表示自从他来到学校陪读以后。该生的睡眠情况有很好的改善。但对于有没有去上课，并不是很了解。因为大学的课程并不是都是在同一时间上课。近段时间会继续关注学生的动态。',''),(121,2016220401006,'家长联系记录表','2017-12-12','','王猛','管理员','','电话','今天下午与该生家长进行了谈话，该生最近情况没有什么特殊的，表现良好，但是学习成绩还是处于很一般的状态，仍然担心该生在期末考试中会有很多不能通过的情况，因为该生之前有请同学帮忙讲解的情况，并且收到了一定的效果，在大一下的时候把大一上的两门数学课程过了。因此，建议该生在临近期末的时候能够找人继续进行课程补习，确保本次期末考试能够通过，该生的数学底子一直不是很好，希望能够提前复习取得好的考试结果，该生家长也表示会在今天给该生打电话了解情况，如果有必要的话再给该生请补习的学生。',''),(123,2014220105013,'面谈记录表','2017-12-13','','','张诗晗','','','这周六是大学英语四六级考试，陈松林如果这次还没过，就会面临拿不到毕业证的问题。而他已经签了工作，那么也会影响工作。12.13给他打了电话，上午10点半，还在床上，和他讲明了重要性，问他最近的状态，他说有在刷题，以前的问题出在听力分数不高上，因为陕西省都不考听力，上次是400分。现在他已经很重视了，马上起来刷题。',NULL),(124,2014220103018,'面谈记录表','2017-12-13','电话','','张诗晗','','','本周六就考四级了，12月13日11点打电话，还在床上，问他考研的情况，他说可能就去试试就算了（根据他的复习状态，在我意料之中）。上次四级400分左右，督促他快点起床看书，并说明了四级的重要性，他表示自己知道利害关系，提醒了他要早点到考场，不要忘记耳机，不能作弊等事项。',NULL),(125,2014220902008,'面谈记录表','2017-12-13','','','张诗晗','','','本周六就考四级了，12月13日11点打电话。他说自己最近在练习听力，因为自己一直在复习考研，英语都是通的，还是比较有信心，同时提醒了他时间、戴耳机准考证，不能作弊能事项。同时，对于考研，他最近有点压力，告诉他要正确看待，雪会排解，同时，告诉他法国4+2项目的事情，嘱咐他考完研就把雅思报了。',NULL),(126,2014220901028,'面谈记录表','2017-12-13','办公室，电话','','张诗晗','','','嘱咐了他时间，打印准考证，带耳机。最近和女朋友关系不错，她在实习，在东苑一起住。上次英语400分左右，差的不多，最近都在看英语，想一次性通过，他问了如果四级过不了是不是真的毕不了业，回复了他同时告诉他可以用雅思托福GRE，他觉着难，和他举了以前学生的例子。嘱咐他可以在考完四级根据自己的情况报名雅思托福GRE其中的一科，毕竟考位不多，他表示应允。同时，他说自己这学期都在看重修，希望自己能多过几门。考试完就去找实习的事情。最近心情还可以，从声音听，感觉也不错，嘱咐他压力不要太大，正确看待。',NULL),(127,2016220401006,'周联系简易记录表','2017-12-12','办公室','','戴瑞婷','','电话','四六级考试临近，但该生没有报上名，询问该生复习情况，该生表示最近还可以，今天去查课看到该生确实听的还比较认真，但是还是很担心其有没有学进去，提醒该生复习方法，以及答疑求助方法。该生对自己的期中考试情况完全没关注，也让该生在上课时及时关注，得知自己期中考试情况。',''),(128,2016220401010,'周联系简易记录表','2017-12-12','办公室','','戴瑞婷','','电话','该生学习情况差，而且爱玩游戏，本学期初承诺好好学习后，仍然不明显改观，多次与家长沟通，母亲也表示没有办法，临近期末，谈话后该生表示会注意，也不愿别人多说，也不愿来办公室。',''),(130,2016220401010,'家长联系记录表','2017-12-16','','','管理员','','电话','告知家长该生情况，该生实验课程没有去上课，实验老师让班长提醒，另据同学反应该生其他课程也常缺课。上周给该生打电话 该生表示自己知道自己的事情，不太愿辅导员、家长管，且让该生来办公室，该生拒绝，说自己知道。问到期中成绩，该生不告诉，只说知道很撇，期末知道好好学。该生家长表示，该生也是在11月份主动给家里打电话说自己放弃了游戏，开始学习。但是半个月来扔存在问题。提醒家长此时正是期末考试复习关键时期，希望和学校一起关注学生情况，多打电话提醒学生学习。并详细给家长讲解了课程的分数组成，家长表示会监督孩子，但是如果这样还不听，孩子确实性格很固执，如果这样 应该让他吃点苦头，不行的话，就让他降级。',''),(131,2016220305033,'家长联系记录表','2017-12-29','','','戴瑞婷','','','家长与学生谈心后 纠结是否是先降级还是等分数出来之后再说。如果等分数出来怕没有过，且达到降级线就只能降级，但学生称应该没有问题，但也不敢保证，因此家长一直很纠结。多次询问意见，建议其在跟学生商量，降级不一定就百分百是好事，一定要从心态方面转变，现在学生的情况并不是其他问题，而是学习时仍然没有进入状态，没有用心，如果这个状态不改变，即使降级也没用。最根本的还是找到原因，该生性格较为内向，内心所想很难清楚，妈妈从日记中看到的反应出该生仍然处于比较矛盾的状态，觉得无法全身心进入学习状态，又觉得对不起身边关心自己的人。建议其咨询心理老师，家长咨询后，心理老师反应又可能还是有忧郁的情况，但希望去医院看看。家长去校医院找之前看过的医生，医生让其去校外的医院。但该生一直不愿配合咨询和看医生，该生家长目前在陪读，也一直在按心理老师说的给学生做工作。',''),(132,2014220901028,'面谈记录表','2018-01-02','办公室和网络','','张诗晗','','','重点：毕业设计和就业情况。\n黄兴表示找了个熟人的公司，请熟人带着做毕业设计。班长给的三方丢了，于是下午来办公室拿新的毕业设计三方，经观察，精神状态不错，心情也还可以，能够做到有问有答。\n关于就业，表示很大的可能性会留在熟人的公司，已经把简历发给了我，并不担心找不到工作。\n还在和女朋友在外居住，感情也不错。',NULL),(133,2016220502030,'面谈记录表','2017-09-29','主楼B1-604','','齐翔','','','苏小龙因为学籍清理降级到2017级，来办公室找我确定调整宿舍等信息。跟苏小龙聊了聊自身的情况，苏小龙自己表示，自己主要是打游戏控制不住自己，导致大一下学期的课程全部挂科，大一上学期自己没有挂科，但是成绩也不是很好。这次学籍清理也可以跟读，但是自己想降级，怕跟读后面也跟不上，下次更危险。问他降级后的打算，自己表示想认真学习，把课补上来。\n通过聊天观察他不是很爱说话，推测他的自我约束能力等方面应该比较差，因此跟他举了一个13级因为打游戏成绩受到巨大影响的同学例子，侧面探探他的态度。他表示自己很担心自己可能做不到那么努力，也怕受到诱惑又坚持不住。又跟他深入的聊了聊，鼓励他要坚持，另外降级到17级，电脑就不要带了，先把课程都过了再说。\n此外，还在介绍13级那个同学情况时提到跟心理中心老师做心理咨询的事，侧面引导他也可以尝试多跟其他人沟通，多听听大家的意见。苏小龙对此还比较配合，抵触情绪不大。我问他需不需要我帮忙预约，苏小龙表示可以，感谢老师。\n整体而言，对苏小龙的情况比较担心，后续要进一步密切关注。\n苏小龙宿舍调到了QB20-211，跟李子轩一个宿舍。\n',NULL),(134,2016220502030,'面谈记录表','2017-11-01','','','王陆一','','','白天跟苏小龙联系电话呼叫限制，QQ没回没有联系上，晚上到宿舍来找他，人也没有在宿舍，通过跟家长多方面联系，晚上8点左右我正在宿舍，家长说给他冲了话费打通了电话说在宿舍看书，我表示我就在宿舍但是并没有人。我给苏小龙打电话，他也说在宿舍，我说我就在你的宿舍，苏小龙就不说话，问他在哪里，他说在顺江网吧打游戏。让他20分钟之内骑个小黄车回来，我就在宿舍等他。苏小龙大概20分钟到了宿舍，我在楼下找了个角落跟他谈话。问他为什么撒谎，而且手机也联系不上，最近早晚自习不上，课也不上，之前聊天不是都答应我的吗？（考虑到今天他撒谎当场被拆穿，怕他心理压力太大，我跟他的谈话基调都是语气上尽量轻松开玩笑的）。苏小龙表示不想跟现实生活中的人接触，只是想在虚拟世界里和他的队友交流。问他到17级后跟同学的相处情况，他说室友很好，班级同学也可以，第一次上英语课班长都把书给了他，自己和别人共看一本书。通过苏小龙描述可以感觉得到他是真的觉得同学还不错。应该是他自身的交流障碍。\n我没有过多的强制他一定要怎么样，主要是引导他一步步来，想离开网吧玩游戏的环境，哪怕没事不去上课，去图书馆看小说也好，先把自己的人拉回来。另外早晚自习这些要参加，不一定跟班级同学打的火热，但是要人在集体中，这样刷刷存在感也好。对于课程，大一上的课程都通过了，但是还是要去上课，一是知识积累，二是要让自己的生活尽量正常化。苏小龙表示自己也很想，有时候就是管不住自己，说着还掉了眼泪，看得出他的内心也很挣扎痛苦。他提到对于父母自己很抵触也很反感，觉得他们很烦，天天打电话追他，我说父母那也是没有办法，不容易，希望能够换个角度理解一下，他表示理解，但是就是觉得很烦。\n聊到心理中心咨询的事，苏小龙表示没有去，自己其实并不是很想去，等他想通了再说。考虑到他的状态，我没有过多的强调这个事，日后在做引导吧。\n',NULL),(135,2016220502030,'面谈记录表','2017-11-10','主楼B1-613','','王陆一','','','因为这两天联系不上他的这个事，加上上次谈话后有两天早自习又没有来，叫过来了解最近的情况。苏小龙还是很痛快就来了，表示最近没有怎么去上课，课都过了，不太想去上，问他在做什么，说最近没有怎么上网，上周末是去了的，最近借了两本书在看。引导他早晚自习课程还是要上，道理上次也讲过了，另外手机这些还是注意下，父母也不容易，找不到人会很着急，我找不到你我也很着急，只有关心你的人才会这么在乎你，希望能理解。苏小龙表示理解，确实手机有点问题。\n苏小龙也表达了对父母的情绪，他们每天两三个电话，一打一个电话就是半个多小时，爸爸打完妈妈打，说的是差不多的话，感觉实在是受不了，尤其有时候晚上在上自习，一个电话过来手机一响自己都感觉一惊。跟他聊了聊，表示非常理解他的心情，但是从另一方面也讲了下父母的感受，苏小龙还是表示理解。他说爱跟爸爸说话，不爱听妈妈说话，就引导他那就多跟爸爸说，可以主动跟父母沟通下，比如每周一三五自己主动打电话回去，如果没有打爸妈再给他打，换一种方式交流。苏小龙也表示认可。\n另外，希望苏小龙和我们大家都坦诚相待，就算是打游戏去了也没有关系，但是一定要说实话，不要撒谎。信任是彼此的，苏小龙表示以后不会撒谎。\n',NULL),(136,2016220502030,'面谈记录表','2018-01-02','寝室','','齐翔','','','我晚上打电话问苏小龙在哪，他说他在网吧。我说你几点回来呢，他说他十点回来，我说可以，我十点在你寝室等你。他回来之后，感觉身体状况还算良好，也比较有精神，就是衣服穿得很薄，我让他下次出门多穿点。我问他你为什么不回来睡觉呢？他说他在网吧里面睡得更舒服一些，还说网吧有个大沙发，刚好够他睡。我说我现在最担心的不是别的，是你的健康问题，我说你看我平时是不是还问你中午吃没吃饭之类的？我问他最近有没有按时吃饭，他也说在网吧更能准点吃饭。他上网的地方是学校南门网吧。他说去年他们少数民族有个政策，就是在36-60分之间，可以算通过。他也说他知道如果下学期还是像现在这种状态的话，就肯定会被退学的。他说自己虽然知道别人不会对他有什么看法，但是还是会觉得，别人会看不起他。我跟他说其实那是你感觉别人会觉得你怎样怎样，其实大家都很忙，根本没有人会在意其他人怎样的。\n',NULL),(137,2016220502030,'周联系简易记录表','2017-10-09','','','齐翔','','QQ','跟心理中心刁静老师联系，说明了苏小龙的情况，刁老师说让他到活动中心410直接预约，还需要填一些信息，那边会有接待员接待，预约具体的心理咨询时间。\n把以上信息告知了苏小龙，同时了解苏小龙的降级手续办理情况。苏小龙表示降级手续办完了，就还差退宿。提醒他尽快办理，早点融入班级。苏小龙表示明天就办理。\n',''),(138,2016220502030,'周联系简易记录表','2017-10-23','','','齐翔','','QQ','苏小龙晚上给我发消息，说已经搬到了宿舍。第二天我跟王猛老师也进行了消息对接，告知原年级辅导员苏小龙已经入住到2017级。',''),(139,2016220502030,'周联系简易记录表','2017-11-13','','','王陆一','','QQ','苏小龙妈妈打来电话说联系不上他，我在QQ上跟苏小龙联系，苏小龙马上回了，问他是否在上课，他说早上信息安全导论没有去上，后两节没课，下午有微积分会去上的。跟他说信安导论已经停课了，他表示不知道。另外，跟他说了妈妈联系不上他的事情，他说不想回，过两天再说，安慰了他一下，也说了我跟妈妈也沟通了，妈妈还是比较通情达理的，也理解他，只是可能有时候方式方法不是很能让他觉得舒服，但是还是给家里回一个，不要让父母担心，他还是表示过两天再说，抵触情绪还是很明显。',''),(140,2016220502030,'周联系简易记录表','2017-11-15','','','王陆一','','电话','午给苏小龙QQ和微信留言都没有回复，中午下班后给他打手机，他接了，问他在哪里说在学校。问他这两天是不是晚上都没有回来，去了哪里，他开始沉默，我问他是不是去了网吧，如果是就跟我说实话，没什么，他说是。说是心情不好，跟家里关系闹崩了，我先是安慰了他，心情再不好也不能夜不归宿，而且在网吧环境那么差，通宵身体也受不了，苏小龙说没有通宵，睡在网吧的。跟他说下午来找下我，苏小龙表示不愿意来，让我可以电话里长话短说。委婉铺垫了下他妈妈想让他回家的事，还没说出口，他就说他妈妈跟他说了，他是不会回去的，而且他妈妈说话是有后半句的，不回去的话就在学校好好学习。那问他怎么想，也不说话，我说其实怎样都可以，但是你不回家，不让你妈来，但是你在学校的表现我们很清楚，也没有好好学习啊，早晚自习不上，课不上，还经常找不到人。后来又跟苏小龙交流了很多，他基本上就是说好，但是感觉应该跟以前一样，行动上应该没啥变化。让他想想，下午回复我自己想怎么办。直到晚上也没有回复我。',''),(141,2016220502030,'周联系简易记录表','2017-12-08','','','齐翔','','电话和QQ','教务科谢老师打电话来催，说苏小龙还没有进行电子注册。之前我已经提醒过他至少三遍赶快去弄电子注册，结果直到今天他都没有把学费交上。后来又给他打了一通电话，他说明天搞定。我说今天是最后一天，他说他还差200块钱，那就今天搞定吧。我打算中午再打一通电话催催他。',''),(142,2016220502030,'周联系简易记录表','2017-12-28','','','齐翔','','电话','以填写离校登记表格为契机，打电话给他，让他填一下离校表格。之前从室友李子轩那里了解到，他很少回寝室睡觉，经常夜不归宿。因为之前也有类似的情况发生，于是我在电话里问他：“你是不是好几天没回寝室睡觉啦？”对面沉默了一会然后说是。我说那你都住在哪里呢？他不说话。我说你是住在网吧吗？他说是。我说你睡在网吧不安全呀，而且也不舒服啊，为什么不回寝室睡呢？我说至少你每天回寝室睡觉行不行？他说可以。答应我每天回来睡觉之后，我让他先把表格给填了。（后记：次日2017年12月29日我问室友李子轩，苏小龙是否晚上回去睡觉了，李子轩说没有。）',''),(143,2016220502030,'家长联系记录表','2017-11-01','无','','王陆一','','电话','想找苏小龙进行谈话，但是QQ没回，电话也呼叫限制，问了同学也不知道他在哪里。于是想先跟家长联系一下，说下他在校的情况，另外也是建立起一个联系。于是给苏小龙爸爸打电话，经过简单了解，苏小龙爸爸是出租车司机，母亲无工作，家里还有个上三年级的弟弟。家里的经济条件不宽裕，是贫困生，父母文化水平也不高。\n对于苏小龙降级的事情，父母知情，大概每周一次打电话联系他，苏小龙都说在学校很好，其实在9月底到10月23号之间的时间里苏小龙并没有到17级来，但是跟父母还说在学校都办理了手续没事。我把自从我接到苏小龙降级后了解到的苏小龙情况给父亲进行了介绍，爸爸表示并不知道他在学校是这样的，每次苏小龙都说好。而且苏小龙并不喜欢跟他们说话。我把9月底和苏小龙第一次见面跟苏小龙说的话跟父亲也进行了描述，苏小龙对自己的情况有很清楚的认知，而且当时也答应的我好好的，可是并没有认真的去执行，这样下去，那等明年9月份2017级学籍清理的时候，很可能就被退学，并且把学籍清理的基本情况跟父亲又介绍了一遍。爸爸表示很着急，可也没有办法，说苏小龙平时一直跟他们都不怎么沟通。我也提到了陪读的事情，爸爸表示在2016级时他妈妈就想过来陪他，一方面苏小龙不同意，另一方面，家里经济条件有限，还有弟弟在读书也需要照顾，确实也比较困难，所以就没有来。我对爸爸说的情况表示理解，但是也提出了这样的建议，以及苏小龙很可能面临的最坏结果，就是退学。希望家长还是多多的跟孩子沟通，我们作为老师也会更多的关注他，但是毕竟不可能24小时守着他，爸爸也表示理解。\n晚上，苏小龙妈妈又几次打来电话问我苏小龙在哪里，我表示我也还没有联系上他，但是一直在跟他的同学和室友联系，待会吃晚饭我准备去宿舍看看他在不在宿舍。苏小龙妈妈反复问我苏小龙的情况，我简单介绍了下，并表示下午在电话中跟苏小龙爸爸说的很清楚（感觉他们夫妻间没有沟通）。晚上8点左右，我正在苏小龙宿舍敲门没有人，苏小龙妈妈打来电话说给苏小龙手机充了话费，已经联系上他，他说在宿舍看书，我说我就在宿舍，里面没人，我跟苏小龙电话联系下再说。我马上给苏小龙打电话，他也说在宿舍看书，我说我就在你宿舍门口，然后苏小龙说在外面打游戏，我让他立刻回来，然后在宿舍楼下跟他进行了大概半个小时的谈话。结束后，给他妈妈电话进行了反馈，首先报平安确定他人回了宿舍，另一方面也如实说了下苏小龙的情况。\n',''),(144,2016220502030,'家长联系记录表','2017-11-13','无','','王陆一','','电话','苏小龙妈妈打来电话说周五开始苏小龙又不接她的电话，能打通就是不接，苏小龙妈妈想过来陪读，这两天就想过来，她已经给内派老师打过电话，内派老师说让给辅导员老师再联系，他们那边没有什么，辅导员老师同意就可以。\n对于陪读的问题，首先从对孩子学习和生活帮助的角度进行了分析，我们作为老师，不存在同意不同意的问题，如果家里面有条件能够陪读，这当然是对孩子很好的，因为毕竟像苏小龙现在的情况，跟其他孩子又不一样，老师也不能24小时看着他。但是考虑苏小龙的状态，我觉得他不会同意，这个我们老师和家长都要和他好好沟通，做工作。不然这样下去，明年9月份的学籍清理，很可能苏小龙就面临退学的危险，他的自我约束能力比较差，也比喜欢跟人沟通，通过我的观察，我觉得他可能存在一定程度的心理障碍，但是他又拒绝到心理中心做咨询。家长表示想来陪读，带他去心理中心，我也表示这样是好，但是还是慢慢来注意方式方法，别把苏小龙逼得太紧反而出事。\n然后跟苏小龙妈妈沟通了下上周五跟吴小龙谈话的情况，苏小龙在爸爸妈妈之间更倾向于跟爸爸沟通，建议父母之间多交流，把想说的内容多通过爸爸来跟苏小龙交流，妈妈也尽量多理解苏小龙的状态，不要让他觉得逼的太紧，我把苏小龙那天跟我说的话跟妈妈也描述了一下。妈妈也表示理解他，现在的问题是不接电话，希望老师跟苏小龙沟通，让他接电话。另外，苏小龙贷款了，剩下的学费给了他4000.但是好像一直没有交，家里希望他尽快交上，让老师问问。\n我随后QQ上跟苏小龙联系，苏小龙马上回复了，问他是否在上课，他说没有，下午有课，然后跟他说了妈妈联系不上的事，他说不想回，过两天再说了，劝说了他一下，他还是表示过两天再回复家里。感觉到抵触情绪还是比较大。我把苏小龙的情况也给他妈妈发了短信，他妈妈表示也接收到了苏小龙的信息。\n',''),(145,2016220502030,'家长联系记录表','2017-11-16','','','王陆一','','电话','跟苏小龙妈妈电话联系，反馈想请假回家的情况，是可以的，走请假流程，但是昨天我跟苏小龙聊了，情况不太好，把具体过程也跟苏小龙妈妈说了。苏小龙妈妈表示他们也很困惑，供他读书各种顺着他，就是不好好学习。也跟苏小龙妈妈表示了这样下去，后面学籍清理肯定很恼火，可能会退学，希望家里跟孩子多沟通，好好沟通，不要吵，苏小龙情绪也不好，现在也不见我。苏小龙妈妈表示中午跟爸爸商量下怎么办，然后再跟我说。\n',''),(146,2016220502030,'家长联系记录表','2017-11-28','','','齐翔','','电话','跟苏小龙妈妈电话联系，苏小龙妈妈已经回家了，他们在成都一共呆了3天，本来是想带苏小龙回家的，但是苏小龙说他想上课，因为以前的课刚好上到这个部分就听不懂了，所以不想回去。我估计这只是借口。苏小龙妈妈还说他已经把学费钱给苏小龙了。\n',''),(147,2016220502030,'家长联系记录表','2017-12-26','无','','齐翔','','电话','分别和苏小龙爸爸、妈妈进行了联系。我跟他们反映苏小龙最近在校表现情况：晚自习几乎不来，班长也和我说他几乎不去上课。我很多次打电话给他，他都是说自己在网吧。昨天晚上直接去宿舍找他他也不在宿舍。我还和两位家长说，苏小龙做很多事情都喜欢拖延，比如上次电子注册的事情足足拖了一个月，最近英才的刘今杰老师联系辅导员，说苏小龙没有去形势与政策的考试，我让苏小龙打电话给刘老师，但是他也是一直拖着不打电话，还有他要补办火车票优惠卡，也迟迟不来拿，我在打电话和QQ都催过他很多次，直到今天都没有过来拿。我还说苏小龙其实内心也很纠结，因为之前苏小龙来上过两天的早晚自习，但是没有坚持下来。他爸爸妈妈也说苏小龙从小学开始就喜欢打游戏，也不太爱和别人说话，现在他们家长也不知道该怎么办，而且苏小龙家只有爸爸在打工赚钱，妈妈在家带小弟弟。他妈妈跟我说，苏小龙从入学到现在，一共给他打了7000多块钱，现在他妈妈为了防止他花钱太凶，都改成十天打一次钱。我和他家长说希望寒假的时候再好好做一下苏小龙的工作。我说我现在最担心苏小龙两点：1、他天天在网吧打游戏，我怕他身体上吃不消，到时候生病了。2、他这种学习状态继续下去可能会在第二次学籍清理的时候被退学。\n',''),(148,2017221302020,'面谈记录表','2017-10-09','早自习教室外','','王陆一','','','谯凯英语四级没有报上，早自习的时候找他谈话。谯凯说当时支付宝没有钱，所以就没有报，后来就忘记了，觉得自己英语还不错肯定能过就没当回事。严肃批评了他，四级报名没报上就无法参加考试，这样跟年级上的节奏就错开了，对自己后续的影响还是很大的。虽然没有报上，早自习和四级模考等一定要认真的跟着学，否则下学期就不可能大面积高频率举行这些活动了，英语基础好跟考试通过是两回事，自己要高度重视。而且这是一种很可怕的意识问题，以后大学里还有很多事都要自己去报名自己去申请，现在不注意，以后必定吃大亏，将来到社会上更是如此。\n另外，因为他没有报名，班级的四级一次性通过率肯定无法达到100%，这个对班级评优班等影响也是很大的，自己以后在班级中要积极表现。\n谯凯表示自己知道错了，以后会注意。\n',NULL),(149,2016220502030,'周联系简易记录表','2018-01-07','','','齐翔','','QQ','我在QQ上问苏小龙有没有按时吃饭睡觉，有没有添衣服，他说有',''),(161,2016220502030,'家长联系记录表','2018-01-08','无','无','齐翔','','电话','联系时间： 2017年1月8日\n给苏小龙爸爸打电话。跟他说今天杨老师打电话说苏小龙没有来参加活动的事情。我还是跟他说苏小龙整天泡在网吧，夜不归宿，苏小龙说自己在网吧睡得更香，他爸爸说苏小龙肯定是在说谎。我建议他爸爸来成都把他接回去，还跟他爸爸说我觉得苏小龙可能心理有问题，我建议他爸爸带着他去看一下心理医生。他爸爸说他上次来成都就有这种想法，但是害怕跟孩子说。我说之前苏小龙就表示自己想去看学校心理中心的老师，但是王老师给他预约了，他又没有去。他爸爸说晚上跟他妈妈再商量一下，看看怎么办，晚上再回我电话。',''),(162,2016220502030,'家长联系记录表','2018-01-08','无','','齐翔','','电话','下午快下班的时候，苏小龙妈妈打来电话，说他爸爸已经把情况告诉了她。她说苏小龙买了28号的票，我告诉她我们18号就放假了，而且苏小龙没有考试，理论上现在就可以走了。苏小龙妈妈说她要再问一下苏小龙为什么这么晚才回去。我跟他妈妈说苏小龙可能心理有问题，建议他们带苏小龙去看下心理医生。我说苏小龙有时候会连续几天不回寝室睡觉，他妈妈听完了之后表示很惊讶，说以前只是偶尔不回寝室，没想到现在都是连续几天不回寝室了。我和他妈妈说了事情的严重性，说爱打游戏或者不去上课只是表面现象，可能有些话他不愿意对家长或者老师说，我怕他想不开。苏小龙妈妈说他知道自己儿子，她觉得她儿子不会做出什么过激的事情来。\n',''),(164,2016220502030,'家长联系记录表','2018-01-09','','','齐翔','','电话','苏小龙妈妈打来电话，说她今天坐火车来成都看儿子，最快周三晚上到成都，让我帮忙预约心理中心的老师。她昨晚大约六点过给苏小龙打电话，听到电话里很嘈杂，问苏小龙在哪，苏小龙支支吾吾半天说网吧。',''),(172,2017221004010,'面谈记录表','2018-01-09','主楼会议室','','齐翔','','','微积分1》期末考试的时候，邹永赫没有来考试。打电话第一遍没有接，第二遍才接。我叫他到办公室来，我想和他聊聊。见了面感觉状态还可以。他说他不想去考微积分是因为公式太多了，感觉自己看不完了，中午本来打算是睡一觉下午再去考试的，结果中午没睡着，想着反正考也考不过干脆就不考了。我问他自己分析为什么会看不完公式，他说平时课也去上了，只有一节课没去上，但是也没怎么认真听，下来也没有花太多工夫在学微积分上。我问他你是不是感觉现在有点小后悔有点小懊恼，他说是的。我说你不要压力太大，考试的时候就应该心无旁骛，考试之前的心态应该是相信自己一定能过，然后一边认真准备，考试之后的心态应该是如果没过也没关系，只是一次考试而已，下次继续努力。我和他说这次不要太后悔，过去的事情就让他过去，安心准备后面的考试，安排好时间复习。寒假回去好好复习微积分，时间很长，应该复习得完，下学期开学再补考。\n',NULL),(173,2014220902013,'家长联系记录表','2018-01-10','办公室','魏娟','张诗晗','','电话','给学生母亲打电话询问情况。\n在日常生活方面，她表示于宗民比较沉迷于虚拟现实的学习，课业的学习几乎没有。\n在心理方面，她表示去过两次心理咨询，但是没有改善，就没有再去，也没有去医院做诊断。\n在学习方面，我说学生曾和我联系问过休学的问题，她表示于宗民是有这样的想法，我和她介绍了休学的流程，并表示还有半年就要毕业，大四下有3个月是在外面实习，可以在家附近找一个工作做毕设，把毕设完成，鉴于于宗民有科目没有修过，故而可以选择延期毕业，她表示考虑一下。\n我嘱咐家长，应该和学生确定好是否休学，若真的要休学，下学期可以不需要过来学校，还是在家里做心理咨询，鉴于于宗民的心理特征，心理的姿态较高，对哲学研究较多，建议可以考虑找心理咨询机构多尝试。如果要休学，也需要有医院出的证明，借此机会可以到医院做鉴定，若有心理问题，可以不耽误治疗。家长表示应允。',''),(174,2017221305009,'面谈记录表','2018-01-10','主楼办公室','','齐翔','','','心理中心回访说该生对自身要求要，学习倍感压力，适应较差。该生遇到困难采取忍者，自我承受的应对，不利于问题与情绪的缓解。于是我找他来谈话了解最近学习动态。他来的时候穿的衣服很少，然后头也没洗，乱糟糟的。我问他是不是刚起床，他说不是，他早上8点钟就起床了，但是懒得梳头。他说他复习微积分的时候总是无法集中精神，总感觉每次去了教室复习，然后都玩手机消磨掉了时间。我跟他说要安排好时间规划，既然去了教室那就好好复习。我说考试之前好好准备就可以了，考完了就不要想太多，我知道你对自己的要求比较高，但是也不要给自己太大的压力，你们这才大一，后面还会有更多机会去实现自己的目标，不用为了一场考试就懊恼不已。最后我跟他说多穿点，这边天气不比东北，但是毕竟没哟暖气，平时勤洗澡，保持个人卫生，最近不要感冒了。他说他已经感冒了，最近在喝板蓝根，走的时候表示感谢老师的关心。\n',NULL),(175,2017221302020,'面谈记录表','2018-01-10','主楼办公室','','齐翔','','','抑郁情绪明显，有酗酒的情况，情绪不稳定，以前有慢性胃病，现在好多了。家庭关系一般，与父母关系疏远，有事也不愿意谈。我和他聊了一下最近的情况，他来的时候穿得很少，连毛衣都没穿，里面一件T恤外面套个加绒的外套就来了，我摸了他的手还挺暖和，他说他刚起床，跑着过来的。他因为之前没有报名四级，所以在英语上没有花太多功夫，他说自己的C语言学的挺好，压力不大，线代可能要重点复习一下。我感觉他精神状态还可以，我告诉他对自己要求高是好事，但是也不要给自己太大的压力，考试考完一门丢一门，平时好好复习就可以了。\n',NULL),(176,2016220401017,'周联系简易记录表','2018-01-09','','','戴瑞婷','','','该生没有去参加概率论考试，打电话问他情况，他说他在图书馆看书，该生气格内向，说话很小声，简单聊了之后让他来办公室面谈。',''),(177,2016220401017,'面谈记录表','2018-01-10','','','戴瑞婷','','','该生性格内向,慢慢的聊了很久，大一上学期该生成绩很好，但据同学和班长反应该生不是很合群，通常不愿意跟班上同学一起行动。但在大一下学期的时候该生成绩，期末成绩出现了严重的退步，从大一上很多科90分以上，到大一下几门课程60分还有1门不及格，是学习态度出了问题。聊天中了解到该生不想走寻常人的路，不想正常的完成学业，自己也表示比较叛逆，谈到少走弯路时，该生表示就是想走点弯路，他说自己走过不少弯路，在高中时期就一年没有去上课，想按自己的方法活，但是最终还是被拉回去高考，所以来到了电子科大。在大一上的时候还知道干什么所以学习成绩还可以，后来又不想像寻常人一样，不想走了样的路。现在开始在做一个游戏软件，他说他心中有方向，但不愿意告诉我，他知道失败的可能性很大，也不知道未来怎么发展，但就是不想学习，失败再说，也许失败后还会选择拿毕业证和学位证。谈到降级和退学的可能性时，该生说这些都想过，并且他想再重新读一次，但是退学还不是很能接受，如果失败了还会不得不要毕业证学位证。该生很厌恶为人处世和人际关系，也很不屑，他自己看过很多书，包括哲学的。很多未来的事自己都不知道，但是也找寻不到意义点。对于后面的两门考试，该生都不想考了，该生表示即使考了也过不了，因为自己从来没有提交平时作业，没有平时分。疏导后，建议该生缓考或补考，等期末成绩出了再看平时成绩到底有多少，该生也表示大一课程也没有去听课，但是自己一看书也就能考那么多分，觉得没有意义。现在在做游戏，遇到很多问题，但是自己查也能解决，未来也能解决，觉得跟团队也是未来成功后的事，没必要跟人打交道。',NULL),(178,2016220401017,'家长联系记录表','2018-01-09','','','戴瑞婷','','','今天了解了该生的想法后，立刻通知该生家长，家长过来，聊了具体的情况，建议家长密切关注学生，进行双方面的引导和疏导。主要跟孩子父亲聊了具体情况，该生父亲也是高校老师，对自己儿子的情况也是很了解，说到的这些情况他们也都了解，但就是这孩子听不进，原来在高中时也是没办法，从小到大就不怎么学，最后看看也能考试。现在这个情况也能理解，孩子对与人交道方面很差，封闭自己，担心他有压力得不到释放，内向又不向外倾诉。家里妈妈可能跟他聊的多些深入些，但也只能随孩子的意聊，给他讲道理都讲不通，他始终在自己的世界里。建议家长和我们共同努力，如果商量不考试，就缓考提前回家休息，该生也是身体容易生病，刚得了流感，在家中多疏导，让该生能够把自己心里所想说出来，能够懂得沟通，并劝该生可以去心理咨询，主要是社交方面的疏导。该生家长也很配合，最终商量明天办理缓考，今天就带回家，家长陪同办缓考，家长还是很重视，回家进一步做工作。',''),(179,2014220105010,'面谈记录表','2018-01-10','办公室','','张诗晗','','','从上午开始，到下午，大概打了50个电话给学生。没接。显示wifi，但是手机静音，根据了解，应该在睡觉。但是不放心，中午我去他外面租房子的民宿找学生，发现，地址是错的。下午再次持续打电话，终于接了，表示确实是在睡觉，地址是在玉锦湾2栋3706，不是告诉我的27.\n约了他来办公室面谈，和他一起算了学分，表示如果实习实训过了，那么小学期不会面临降级的问题，建议他可以选择延期毕业而非降级，他问了一些关于延期毕业的事情，都一一解答。\n关于最近情况，他表示还是有压力，主要在学业和家庭关系上，还是希望自己能够在下学期把重修全过了，这样就不必延期毕业。鼓励他把毕业设计赶紧顶岗。\n关于其他压力，他表示自己心理健康，肯定不会寻死觅活。',NULL),(180,2014220105010,'家长联系记录表','2018-01-10','办公室','魏娟','张诗晗','','QQ 电话','关于联系频率。表示2号联系了，之后便不接电话，今天也打了电话，但是依旧没有接。\n对孩子特别不放心，但是不得其法，有时候态度会稍微差点。\n在QQ 上和她谈了特别多，后又打电话给她，一是告诉她学生联系上了，二是嘱咐注意事项，三是说了今天和董帅志的谈话内容。',''),(181,2016220401006,'周联系简易记录表','2018-01-09','','','戴瑞婷','','','该生最近状态正常，查考见到后聊了一下，考试都参加了，但是重修报名后没有缴费，所以重修都没考，自己感觉正考还好，希望他继续保持状态，把本学期课程考好。',''),(182,2014220902013,'家长联系记录表','2018-01-11','办公室','魏娟','张诗晗','','QQ','家长给我回了关于询问于宗民情况的QQ消息，结合昨天的内容，回复如下：\n晚上跟于宗民谈回学校的事，他特别抵触，感觉他还是想逃避，可能感觉自己毕业有困难怵头吧！现在天天在家看书，有时写东西，有时上网玩游戏，说是研究他喜欢的那个“虚拟现实”。只要不提回学校好像还挺高兴，一说学校，毕业的事就特别烦躁。不知道他在学校跟老师或者同学有过矛盾吗?不知道该怎样解开心中的结。我给他约了安定医院的心理专家，准备再去看看。上次找到那个心理老师没有起到什么作用。\n',''),(183,2016220502030,'面谈记录表','2018-01-11','红旗宾馆四楼房间','','齐翔','','','他妈妈敲了好半天门才开，看到他整个人精神状态不是很好，眼睛都肿了，而且也几天没洗头的样子。我问他为啥我打电话你总是不接呢，他说是因为他会把手机塞到（网吧里的）沙发缝里，放在桌子上容易被偷。一开始他什么话也不想说，只有当我跟他聊游戏，他才和我搭几句话，比如我问他，你多久开始玩魔兽世界的呀？那个游戏是RPG类的游戏吗？他就会回我几句，我以此为切入点，打开他的话匣子。后来他跟我说，他之前不愿意回寝室睡觉是为了省钱，因为晚上上网的费用更低一点。所以他就晚上上线，白天就把电脑关了休息。他说他一开始买了28号的车票是因为时间记错了，他不想回家是因为家里是个小县城，又是新疆管得严，他说他回家就像“坐牢”一样，又没办法上网（因为他家要拆迁了，所以电信局不愿意拉线），爸妈还会管着他，从小又是在外地上学，所以家乡也没有什么朋友可以玩得来的，所以就只能上网打游戏，但是家里又没网，所以一想到这些就不想回去，宁愿在学校待着。我和他说如果你要在学校待着，必须保证每天都回寝室睡觉，做得到吗？他说自己做得到。我说南门这边治安不是很好，经常出安全事故，你这样天天不回寝室，泡在网吧里，一是你自己身体吃不消，二是因为你又总是接不到我们的电话，作为老师，作为家长，肯定会担心你啊。整个下午谈话下来给我的感觉就是，苏小龙真的是游戏成瘾，他只想和我谈游戏，谈怎么才能接通他家的网线，其他的话题都不太感兴趣。他妈妈说她来的时候，他爸爸就说了，反正待在学校也没啥事，明天就带他回去。\n',NULL),(184,2016220502030,'家长联系记录表','2018-01-11','红旗宾馆一楼会客厅','无','齐翔','','面谈','苏小龙妈妈到了红旗宾馆之后，我和他妈妈在红旗宾馆一楼会客厅谈了一个多小时。他妈妈说苏小龙以前就爱玩游戏，然后也没管太多，没想到就上瘾了。高中的时候是在广东那边上的学。去年也不知道是咋了，就突然开始迷上了游戏。他妈妈推测可能是不是谈恋爱分手的原因。她妈妈说他来的时候就和苏小龙说呢，一起去心理中心那边看下心理“医生”，但是苏小龙说自己没病，不用去。他妈妈担心苏小龙去了也不配合，就让苏小龙在酒店睡下了。我和苏小龙妈妈说，苏小龙这样也挺不容易的，从我们学校毕业，还是比较好找工作，如果真的因为爱打游戏而退学了真的挺可惜的。他妈妈说她也是这样想的，现在她就打算在附近租个房子，下学期来陪读。',''),(185,2017221301011,'面谈记录表','2018-01-10','主楼B1-604','','齐翔','','','    上次心理中心给的回访反馈，说刘忠奇肠胃不好。我谈了之后，他说他已经开始吃中药了，是已经熬好了的那种袋装的，正在调理。我提醒他冬天多穿点衣服。他穿的很单薄，里面就穿了一件T恤，衣服大敞着。最近一直在复习准备考试，我说你不要自己压力太大。考试心态放平和。\n',NULL),(186,2016220105027,'面谈记录表','2017-10-17','','','王陆一','','','文梵在2016级因为学籍清理降级到2017级，原辅导员李周跟我电话联系说明了情况，然后文梵及其父母一起来到办公室办理降级的相关手续，并进行了交流。\n通过交流，文梵性格方面比较开朗，说话沟通都没有什么障碍，对自己的问题认识也比较清晰，在2016级大一时自己的想法很多，目标比较高，但是自己行动力比较差，而且总觉得自己还是不错的，但是实际上身边的每个人都很优秀也很努力，遇到一些困难后自己心理上对学习各方面信心也受到影响。现在学习落下了很多，自己想重新再来一年，把之前的补上。\n跟文梵及家长也结合他们描述的文梵情况进行了分析，强调了大学里目标的重要性以及行动力的重要性。要保持虚心的态度认真学习，脚踏实地。既然现在选择了降级，那么也是付出了一定的代价，更要能够珍惜以后的时间。要求文梵要按照2017级的要求进行学习，哪怕是已经过了的课程，仍然要跟着学习，把课程掌握的更好，不能无故缺课，早晚自习这些都要按照2017级的要求走。对于自制力差的问题，希望文梵自己能够认真对待，并且依靠外力来克服，比如跟着宿舍的同学一起上课等等，要想办法。另外，跟家长也做了沟通，希望家长在以后的时间里多多督促，毕竟大学里这么多的学生，老师不可能时刻看管文梵在做什么，既然现在大家也很清楚他的问题所在，那么如果到了2017级还是老样子，那后面依然会面临很严重的问题。同时还提醒了两个年级培养方案不同等客观情况，提醒文梵及家长到教务部门了解清楚，让教务帮忙进行选课等。\n家长也表示会对孩子进行监管，会多多联系，希望文梵能够自我觉醒，认真对待。\n',NULL),(187,2016220105027,'面谈记录表','2017-11-02','B1-611','','王陆一','','','文梵到年级后通过班委等侧面了解情况还比较稳定，但是本周连续两天没有上早自习，叫他来了解最近状态。文梵说这两天没有来早自习都是因为睡过了，自己对闹铃好像总是听不到一样。宿舍的室友人都很好，也都很爱学习，习惯也都很好，之前他起不来还叫他，但是可能后面也不好意思叫他了。跟他分析了这个问题，让他想办法，比如多设几个闹铃，另外主动让宿舍同学叫他等等，不然同学肯定也不好意思了。文梵也表示这个是自己的问题，主要是不够重视，自己接下来一定不迟到了，想办法。\n跟他了解最近的学习情况，文梵说都在跟着走，课还是都在上，感觉宿舍同学的氛围也挺好，自己也觉得很好。鼓励他要坚持，现在早自习已经开始松懈，不能再回到原来的老样子。\n另外，提醒他还是多跟班上的同学交流，毕竟没有住在班级的宿舍里，要多熟悉同学。自己在学习和生活方面遇到什么困难和困惑，要多和我和齐老师交流。文梵也很感谢老师的关心，表示自己一定会努力。\n',NULL),(188,2016220105027,'面谈记录表','2017-12-26','主楼B1-613','','齐翔','','','之前通过班长了解到文梵很久不去上自习和上课，所以找他来谈一下，他也很爽快的答应了。之前他就因为焦虑的原因去找过心理医生，现在感觉好一点了。他对自己的要求很高，但是执行力又太差，眼高手低导致心态不平衡。最近晚上已经坚持了10天长跑，在派菲特办了一张卡，每天坚持了40分钟以上，希望自己能减肥，我鼓励他坚持下去。\n我提醒他说，现在不需要想太多未来会怎么样，想得越多越焦虑，不如脚踏实地好好的做好现在的每一件事，船到桥头自然直。还有要注意这次的英语重修一定要过，虽然其他课程没有期末考试，但是也要注意至少要保证下学期开始上微积分2线代2等课程的时候，要跟得上老师和同学们的节奏。\n文梵也表示自己会努力，并表示很感谢老师关心他。\n',NULL),(189,2016220105027,'面谈记录表','2018-01-11','宿舍','','齐翔','','','早上去巡考英语考试的时候，发现文梵没来考试，打电话数次不接，遂前往寝室，发现寝室门没关，我打开门发现文梵在被窝里睡觉。我问他为什么不去考试，他说就是不想考，考不进去，没有平时成绩，复习的时候也看不进去，反正还有补考，补考的时候再考就行了。后来我就出门给他爸爸打电话反映了一下情况，他爸爸向我咨询补考和重修的相关流程。我和他爸爸说我担心文梵这个状态下去肯定要被退学，但是现在我感觉他心理也有点小小的抑郁了，最好家长来一下，来陪陪孩子，顺便去看下心理医生。文梵爸爸表示理解，他说明天就会来成都陪孩子。文梵爸爸说自己打电话给孩子不接，问我能不能把电话给孩子，让他和孩子聊两句。我把电话开了免提，然后他爸爸先是具体问了什么情况，安慰了一下。\n',NULL),(190,2016220105027,'面谈记录表','2018-01-11','宿舍','','齐翔','','','（受文字限制接上条）文梵袒露了自己的心声说：爸爸你不要安慰我了，我知道我现在什么情况。我也不知道自己是咋了，反正就是不想学习，一点也不想学习，我好几次看到那个书，我都想把书撕了，就是很烦，就是不想学习。之前有几天我坚持起床了，去上课，去早自习，去复习，晚上还去跑步，我起的比寝室上早自习的室友还早，但是不行呐，我坚持几天就坚持不下去了。还有我每天想跑步减肥啊，我跑了几天也就是坚持不下去了，我控制不住想吃东西啊。我咋是这种人喏，我感觉我就是个废物，我咋个连这么简单的事情都做不下去呢？昨天晚上复习英语的时候我难受啊，我躺在床上觉也睡不着。文梵说的时候，几度开始啜泣。他爸爸说：娃儿嘞，爸爸妈妈不求你有多少多少出息，你在爸爸妈妈的眼里一直都是很优秀的孩子，是把爸爸妈妈的骄傲，我每次出去和别人说我都说我儿子很优秀，考到这么好的大学。每个人都有自己的低谷，你的低谷可能就是大学的时候，但是有的人的低谷却是小学的时候、中学的时候，他们熬过去就好了。你要给自己一点信心，现在齐老师和爸爸妈妈一起，帮你走出来。后来文梵爸爸跟我说，他觉得是文梵以前都是顺风顺水，接受不了打击，现在自尊心受挫了。电话挂掉之后，我也又和文梵聊了一下，我说懒惰之心人皆有之，并不是你起不来床就怎么样了，我也经常不想起床啊对不对？而且你不需要联想太多，什么今天起不来床，那就不能复习，不复习就会挂科，挂科就会退学。而且那些没有高考成功的同学，他们的人生也并不是就非常昏暗啊对不对？（举了个实例）后来我问他说你是不是说你跑步坚持不下来，那要是有人天天约你出来跑步你坚持的下来不？他犹豫了一会儿说，可能吧。后来我说，那我们今晚出来跑步吧，怎么样？他说好。（后记：晚上的时候，他睡过头了，迟到了十分钟到了操场，我们跑了三十分钟之后回宿舍，他回去的路上和我说，他感觉在17级整个氛围比以前16级要好很多，不管是辅导员还是同学，就感觉同学们都很努力，然后辅导员也很关心他）',NULL),(191,2014220104022,'周联系简易记录表','2018-01-12','QQ、电话和办公室','','张诗晗','','','学生询问我为何要交延迟申请，我解释了原因，并问他是否需要帮助。在谈话中，学生提到，延迟申请是否能提高百分之一的就业率，感觉其有一些排斥的情绪。\n后打电话给他，当时在地铁上，在去面试实习回来的路上，听起来心情不错，也能够称呼我。约了他来办公室交延期顶岗申请表，并且表示我会帮助他处理好打印等问题，请他来签字就可以，他表示了同意。\n到了办公室后，面带微笑，看起来精神状态不错。刚刚从公司面试回来，公司因为在扩大规模，要求不高，也都如实回答了公司的问题，不会就是不会。公司要他去试用期。必修课还差5门，选修9分，表示本来不打算做毕设，直接二次答辩，现在觉着也可以先毕设，然后延期毕业修学分。和家人一直有联系，上一次联系是上周，和家长，表示家长也挺辛苦，都是底层，蛮希望他能毕业。',''),(192,2014220103018,'面谈记录表','2018-01-12','QQ','','张诗晗','','','学生已经到家了。没去考研的事情家长也知道，现在准备找工作，没法出国，四级还没过',NULL),(193,2014220105013,'面谈记录表','2018-01-12','QQ','','张诗晗','','','已经找到工作了。',NULL),(194,2014220902008,'周联系简易记录表','2018-01-12','QQ','','张诗晗','','QQ','考研没去，四级也没过。准备就业。',''),(195,2016220502030,'家长联系记录表','2018-01-13','','','齐翔','','电话','给苏小龙妈妈打电话，让她先住在外面酒店，酒店费用我争取看看学院能不能报销，苏小龙妈妈表示这个钱她自己出，她就一直在这里待到28号再回去。',''),(196,2016220105027,'家长联系记录表','2017-09-21','B1-604','齐翔','王陆一','','','文梵在2016级因为学籍清理降级到2017级，原辅导员李周跟我电话联系说明了情况，然后文梵及其父母一起来到办公室办理降级的相关手续，并进行了交流。\n通过交流，文梵性格方面比较开朗，说话沟通都没有什么障碍，对自己的问题认识也比较清晰，在2016级大一时自己的想法很多，目标比较高，但是自己行动力比较差，而且总觉得自己还是不错的，但是实际上身边的每个人都很优秀也很努力，遇到一些困难后自己心理上对学习各方面信心也受到影响。现在学习落下了很多，自己想重新再来一年，把之前的补上。\n跟文梵及家长也结合他们描述的文梵情况进行了分析，强调了大学里目标的重要性以及行动力的重要性。要保持虚心的态度认真学习，脚踏实地。既然现在选择了降级，那么也是付出了一定的代价，更要能够珍惜以后的时间。要求文梵要按照2017级的要求进行学习，哪怕是已经过了的课程，仍然要跟着学习，把课程掌握的更好，不能无故缺课，早晚自习这些都要按照2017级的要求走。对于自制力差的问题，希望文梵自己能够认真对待，并且依靠外力来克服，比如跟着宿舍的同学一起上课等等，要想办法。另外，跟家长也做了沟通，希望家长在以后的时间里多多督促，毕竟大学里这么多的学生，老师不可能时刻看管文梵在做什么，既然现在大家也很清楚他的问题所在，那么如果到了2017级还是老样子，那后面依然会面临很严重的问题。同时还提醒了两个年级培养方案不同等客观情况，提醒文梵及家长到教务部门了解清楚，让教务帮忙进行选课等。\n家长也表示会对孩子进行监管，会多多联系，希望文梵能够自我觉醒，认真对待。\n',''),(197,2016220105027,'家长联系记录表','2017-11-24','','','齐翔','','电话','和文梵爸爸交流文梵在校学习情况。我和文梵爸爸说文梵最近至少有两周都没来早自习了，课偶尔会去上。而且他上次跟我说他去温江看病了，文梵爸爸和我说是因为他去找了心理医生，自己也想摆脱自己自制力差的问题。\n',''),(201,2016220105027,'家长联系记录表','2017-12-26','','','齐翔','','电话','和文梵爸爸交流文梵在校学习状况。我和文梵爸爸说文梵最近没有去上晚自习，也很少出现在课堂上。而且他去年还有一门英语课没过。两次下寝室，晚上的时候（昨晚），他都不在宿舍里，而且每次与他联系要不就是电话关机，或者是不接，要不就是QQ隔天或者是很晚才回复我。文梵爸爸表示了解了这个情况，后面会和孩子沟通。\n',''),(202,2016220105027,'家长联系记录表','2018-01-11','','','齐翔','','电话','我到了文梵寝室之后，我就出门给他爸爸打电话反映了一下情况，他爸爸向我咨询补考和重修的相关流程。我和他爸爸说我担心文梵这个状态下去肯定要被退学，但是现在我感觉他心理也有点小小的抑郁了，最好家长来一下，来陪陪孩子，顺便去看下心理医生。文梵爸爸表示理解，他说明天就会来成都陪孩子。文梵爸爸说自己打电话给孩子不接，问我能不能把电话给孩子，让他和孩子聊两句。我把电话开了免提，然后他爸爸先是具体问了什么情况，安慰了一下。文梵袒露了自己的心声说：爸爸你不要安慰我了，我知道我现在什么情况。我也不知道自己是咋了，反正就是不想学习，一点也不想学习，我好几次看到那个书，我都想把书撕了，就是很烦，就是不想学习。之前有几天我坚持起床了，去上课，去早自习，去复习，晚上还去跑步，我起的比寝室上早自习的室友还早，但是不行呐，我坚持几天就坚持不下去了。还有我每天想跑步减肥啊，我跑了几天也就是坚持不下去了，我控制不住想吃东西啊。我咋是这种人喏，我感觉我就是个废物，我咋个连这么简单的事情都做不下去呢？昨天晚上复习英语的时候我难受啊，我躺在床上觉也睡不着。文梵说的时候，几度开始啜泣。他爸爸说：娃儿嘞，爸爸妈妈不求你有多少多少出息，你在爸爸妈妈的眼里一直都是很优秀的孩子，是把爸爸妈妈的骄傲，我每次出去和别人说我都说我儿子很优秀，考到这么好的大学。每个人都有自己的低谷，你的低谷可能就是大学的时候，但是有的人的低谷却是小学的时候、中学的时候，他们熬过去就好了。你要给自己一点信心，现在齐老师和爸爸妈妈一起，帮你走出来。后来文梵爸爸跟我说，他觉得是文梵以前都是顺风顺水，接受不了打击，现在自尊心受挫了。\n',''),(203,2016220105027,'家长联系记录表','2018-01-12','B1-611','文樊','齐翔','','面谈','文樊爸爸妈妈到达成都之后，表示主动和我约谈。我们就在B1-611谈话。文樊的状态看起来比昨天早上好了很多。他爸爸先是问他愿不愿意休学，因为他现在的状态确实不适合学习，他说他觉得休学一年之后，压力会更大，因为同龄人都已经毕业两年了，所以不愿意休学。他爸爸比较尊重他的意见，说只是有这个可能性，提出来问你想不想要休而已，并不是强求你休学。后来文樊说自己的问题就是执行力太低。我给他分享了几个提高自制力或者是执行力的干货方法。我说时间管理的能力直接决定了你执行力的高低，如果事情太多，你会觉得不管从哪一件开始做你都做不完，所以不想做；如果事情太少，你会觉得今天不做明天还可以做，所以只有当事情安排到刚刚好不多也不少的时候，你才会有执行力。文樊的爸爸妈妈都连连表示赞同，而且文樊的爸爸也举了好多个例子。文樊总是想着学业优秀才能走向成功，文樊爸爸和我都劝他，说其实这是受你阅历所限，你才会这样想，其实你再过个15年左右，你再回头看自己降级或者是休学这段日子，算个啥嘛。文樊爸爸也说他以前就是复读的，上次同学聚会，发现混得好的最后都是复读的同学。文樊在谈话中说他比较信任学校的心理中心的咨询老师，他手因为学校的心理中心是和四院合作的，而且他已经进行了5次咨询了，但是感觉没什么效果，他说心理中心的老师给他说的就是些不要想太多啊什么的，就没有多大建设性的建议。\n',''),(204,2016220502030,'面谈记录表','2018-01-15','宿舍','','齐翔','','','早上打电话给苏小龙妈妈。他妈妈说苏小龙昨晚回寝室睡觉了，没有和她一起睡，所以早上我去寝室找苏小龙，10点多去的，苏小龙还没起床。苏小龙说他现在不打算回去了，把28号的票都退了。我问他为什么，他说他不想见到他爸爸，他说他爸爸从他小时候就控制欲非常强，从小看不惯他，不让他看电视玩电脑。每次有什么事情，他爸爸只会威胁他。前天他爸爸给他打电话，说如果不回家就断他的生活费，所以他这次打算跟他爸爸犟到底。我问他觉得这样有意义吗？他说觉得有意义，不然以后他弟弟，他妈妈都要被他爸爸威胁。我说你要理解你爸爸，你爸爸也不容易，一个人要养活你妈妈、你和你弟弟，甚至还有你爷爷奶奶外公外婆。他说他理解他爸爸，但是他爸爸不理解他。他说从小他爸爸就没有和他平等的交流过。\n',NULL),(205,2016220502030,'家长联系记录表','2018-01-15','','','齐翔','','电话','给苏小龙爸爸打电话，把今天苏小龙跟我说的话，还有我跟苏小龙说的话，跟苏小龙爸爸说了。苏小龙爸爸听了之后连连叹气。我跟苏小龙爸爸说，对于叛逆期的孩子，我们做他的思想工作千万不能太生硬，不然更会引起他的反感。他爸爸说现在他主要担心的是苏小龙会不会越来越沉迷网络，我说目前阶段首先考虑的是他的安全问题，至于玩游戏，可能只是他寄托精神世界的一种方式。我让他爸爸好好的和苏小龙再商量一下，平等地去交流，比如可以说“我今天早上跑了一趟电信局，帮你问了接网线的事情”，让孩子感觉到你在试图改变自己。',''),(206,2014220402032,'面谈记录表','2018-01-09','学生宿舍','','洪磊','','','该生买了很多书籍，科幻类和哲学类的居多，很多都还没有开封，包装是新的。\n喜欢蹲在宿舍的桌子下面看书\n据寝室同学反映存在有社交障碍，例如：去超市买矿泉水，可以捏着水在原地站15，不肯上去和收银员结账\n聊天中对于未来的规划不清楚，没有目标动力\n反复和我探讨“人活着的意义？”',NULL),(207,2014220402032,'面谈记录表','2018-01-11','寝室','','洪磊','','','推开寝室的门，江宸蹲在地上看书《西方哲学史》\n对我的到访也比较接受，但是之前约定的理发还是没有完成。\n天气转凉，母亲邮寄了一个包裹，里面是厚毛衣和羽绒服，可是江宸放在桌子旁边的地上，并没有拆封，身上的衣服比较单薄，也不愿打开包裹，说是“特别麻烦”\n谈话期间，江宸电话响了，又是外卖，陪他下楼拿外卖，一路走一路聊，他和我聊到了想学心理学，从而能更好的了解自己，但是他还是比较拒绝去心理中心接受心理辅导\n江宸和外卖小哥很熟悉，这家米线他点了19次，每次都加带两瓶矿泉水。都是喝矿泉水和可乐。',NULL),(208,2017220303001,'周联系简易记录表','2018-01-15','主楼B1-604','','王艳艳','','面谈','俞杰：\n爸妈在云南出差，过年才回家，(妈妈在初中的时候就去云南了，爸爸在学生高三毕业后也去了云南)，目前学生跟着舅舅一起生活。父母平均一个月跟他联系一次，学生不会主动跟父母联系，有什么事也不喜欢告诉父母，认为父母离开自己是去追求他们的自由和想要的生活了，平时不会想念父母，父母的优先级最低。但是对于寒假期间父母不在身边这件事，还是表现出有点失落。学生认为大学体验和高中差不多，没什么两样。而且谈到他喜欢一个人独处，不喜欢跟其他人交流，他认为跟别人打交道是一件很累的事情，因此对于宿舍生活很不适应，不喜欢和室友生活在一起，但是不是因为室友身上存在什么问题，只是单纯的不喜欢群体生活和群体活动，又因为没有其他的解决办法，也慢慢接受了，但是心里还是会很难受。他在寝室买了床帷，经常自己一个人拉着床帷呆在床上。他会经常跟一个高中同学（同桌）聊天，但他觉得他俩之间也是玩的好，并不是很了解对方。他没有太多的兴趣爱好，但是喜欢想事情，特别喜欢想自己在世界各地旅游的事情，觉得很奇妙，也看一些跟哲学有的书籍，但是不会刻意去看。喜欢听音乐，最近也在想去学一下画画和写作。平时在学校就是学习睡觉，没有其他的活动，作息正常，假期可以一觉睡到12点。四级考试之后带了电脑，但是一般用于看视频和写代码，很少玩游戏。因为喜欢独处，学生一有机会都会回家一个人呆着，也喜欢在家里玩游戏。对于四年之后，他觉得能考研就考研，考不上就就业，想从事游戏开发，或者给游戏配音乐的工作。学生谈到说他喜欢航海或者航空，在宇宙间穿梭，觉得自己生不逢时。\n\n在价值观或者人生观上面，学生认为活着没有太大的意思，只是时间在推着自己往前走，但是又怕死。他对万事万物报有一颗平常心，顺其自然，好心情和坏心情对他来说没什么区别，而且心情不好的时候，学生说他会自己去调节，然后很快走出来，没有什么他想不通的问题。谈到他从小学开始就有这么一种情况：站在高处往下望会想跳下去，手里拿刀的时候会想伤害自己，但是他又能克制住自己，而且主动的避免把自己放在类似的环境中，他说到他怕死，然后一直都在让自己远离危险，比如尽量不从高往低看，尽量不拿刀子等。并且认为既然从小学就有这些类似的感觉，而自己到现在都好好的，说明没什么问题。\n',''),(209,2017220303001,'面谈记录表','2018-01-15','主楼B1-613','','王艳艳','','','俞杰：\n爸妈在云南出差，过年才回家，(妈妈在初中的时候就去云南了，爸爸在学生高三毕业后也去了云南)，目前学生跟着舅舅一起生活。父母平均一个月跟他联系一次，学生不会主动跟父母联系，有什么事也不喜欢告诉父母，认为父母离开自己是去追求他们的自由和想要的生活了，平时不会想念父母，父母的优先级最低。但是对于寒假期间父母不在身边这件事，还是表现出有点失落。学生认为大学体验和高中差不多，没什么两样。而且谈到他喜欢一个人独处，不喜欢跟其他人交流，他认为跟别人打交道是一件很累的事情，因此对于宿舍生活很不适应，不喜欢和室友生活在一起，但是不是因为室友身上存在什么问题，只是单纯的不喜欢群体生活和群体活动，又因为没有其他的解决办法，也慢慢接受了，但是心里还是会很难受。他在寝室买了床帷，经常自己一个人拉着床帷呆在床上。他会经常跟一个高中同学（同桌）聊天，但他觉得他俩之间也是玩的好，并不是很了解对方。他没有太多的兴趣爱好，但是喜欢想事情，特别喜欢想自己在世界各地旅游的事情，觉得很奇妙，也看一些跟哲学有的书籍，但是不会刻意去看。喜欢听音乐，最近也在想去学一下画画和写作。平时在学校就是学习睡觉，没有其他的活动，作息正常，假期可以一觉睡到12点。四级考试之后带了电脑，但是一般用于看视频和写代码，很少玩游戏。因为喜欢独处，学生一有机会都会回家一个人呆着，也喜欢在家里玩游戏。对于四年之后，他觉得能考研就考研，考不上就就业，想从事游戏开发，或者给游戏配音乐的工作。学生谈到说他喜欢航海或者航空，在宇宙间穿梭，觉得自己生不逢时。\n\n在价值观或者人生观上面，学生认为活着没有太大的意思，只是时间在推着自己往前走，但是又怕死。他对万事万物报有一颗平常心，顺其自然，好心情和坏心情对他来说没什么区别，而且心情不好的时候，学生说他会自己去调节，然后很快走出来，没有什么他想不通的问题。谈到他从小学开始就有这么一种情况：站在高处往下望会想跳下去，手里拿刀的时候会想伤害自己，但是他又能克制住自己，而且主动的避免把自己放在类似的环境中，他说到他怕死，然后一直都在让自己远离危险，比如尽量不从高往低看，尽量不拿刀子等。并且认为既然从小学就有这些类似的感觉，而自己到现在都好好的，说明没什么问题。\n',NULL),(210,2016220502030,'家长联系记录表','2018-01-15','校园超市门口','','齐翔','','面谈','和苏小龙妈妈面谈，苏小龙妈妈说苏小龙从昨晚开始就待在寝室，中午也不去吃饭，苏小龙的上网费已经用完了，她说苏小龙饭卡里还剩100多块钱，苏小龙打算用这100块钱撑到28号。我和苏小龙妈妈说其实她已经把28号的票退了。小龙妈妈问我火车票优惠卡的事情。她说他一会儿就把苏小龙的卡拿去吃饭，然后也给苏小龙打一点饭回来给他吃。',''),(211,2016220502030,'家长联系记录表','2018-01-15','无','','齐翔','','电话','苏小龙爸爸打来电话，说是和苏小龙沟通过了，诚恳的和苏小龙道了歉，说你回来吧，我不会管你玩电脑的。苏小龙表示他28号再回去（之前说28号的票已经退了，整个寒假都不回去，其实道了歉也是有效的）。苏小龙说新疆的网吧根本没有办法打游戏。（我问了新疆的朋友，新疆的网吧确实配置很渣，网也很卡，没有办法流畅运行魔兽世界。）苏小龙一直揪着28号这个日期不放，我觉得他28号肯定有什么事情，有待询问。',''),(212,2016220502030,'周联系简易记录表','2018-01-15','无','','齐翔','','电话','苏小龙之前说自己不想休学，我打电话给他，让他写一个下学期的计划书给我，里面包含了你选了那些课程，准备如何学这些课程等内容。我说你写好明天或者后天给我，我帮你参谋一下分析一下。他支支吾吾半天，好像有话想说，但是又没说出口，最后就轻声答应了。',''),(213,2016220502030,'周联系简易记录表','2018-01-16','','','齐翔','','电话','和苏小龙打电话，问他爸爸都和他聊了什么，他说他爸爸口头上道了个歉，但是也没有做出实质性的改变。我约他出来吃饭，他说他不想吃饭，不想聊。我说我不聊，我什么话也不说，行不行。他说不行。我问他28号是不是什么特殊的日子，你为什么之前退了28号的票，现在又买28号的票呢？他说一开始是记错了日子，但是现在也没买28号的票。我问那你准备什么时候回去呢？他说他不回去了，就是觉得烦。我说你单纯觉得烦就不想回去吗？他说对。',''),(214,2016220502030,'面谈记录表','2018-01-16','寝室','','齐翔','','','上午约他出来吃饭，他不出来。我担心他在寝室不吃东西，所以去校园超市买了一些方便面、纯牛奶、面包和饼干给他送到寝室了。室友李子轩在寝室给我开的门，他躺在床上玩手机，我看到苏小龙桌子上放着饭，应该是他妈妈中午给他带的。我把东西放在他桌子上，跟他说要按时吃东西，我买了些东西放在你桌子上，你要饿了的话就吃。他没说话。中午一点的时候在QQ上回我：“谢谢齐哥”。我提醒他注意休息，他说“好的”。',NULL),(216,2014220402032,'面谈记录表','2018-01-17','宿舍','','洪磊','','','江宸面临要找实习，却一直未行动，简历没有开始做。\n他的头发已理过，看起来比较精神，和寝室同学在玩游戏，情绪比之前要好。',NULL),(217,2014220902021,'面谈记录表','2018-01-17','办公室','','张诗晗','','','通过QQ关心颜铭的情况。告诉我自己遵医嘱加倍服药，病情加重。问其神秘时候回国，回答说如果要在英国企业实习的话，需要多呆一年，且还需要重修几门科目。暂时回不来。可能要延期毕业。\n现在是重度抑郁，爸爸是医生，但是自己的病情不在他的治疗范围内。自己对自己的病情很清楚，也能够遵医嘱。\n问其是什么造成了现在的情况。说那说起来就长了，想和我打电话，但是担心浪费我的时间。我告诉他不用担心，我想帮助他，哪怕一点点。\n与他通电话44分钟。内容主要如下：\n1.昨天吃了饭，但是在这之前已经一天半没有吃饭。刚刚去看心理医生时候称了体重，是53公斤，服药后58公斤，现在问题严重，可能又瘦回去了。\n2.医生已经诊断为重度抑郁，服药后，有好转，但是现在出现反复，遵医嘱加倍服药，若效果不理想，会换药。\n3.在英国和其他同学一起住，但没朋友，也不会主动去约朋友，平时宅宿舍，听了 我的建议，准备在周六日的时候主动约同学出去散心。\n4.自己现在感觉情况不好，主要在学习和生活两方面，学习没有动力，挂了几科，但是英国学校不会勒令生病的同学退学，所以自己要继续重修。生活方面，感觉这几个星期严重了，头痛，没食欲。\n5.自己在上星期尝试过自杀，用绳子勒脖子，自己放弃，不想给房东添麻烦，不想让妈妈和妹妹担心。\n6.自己在做心理咨询，但是感觉没什么进展。\n7.在初中开始就有些抑郁，主要因素在家庭关系。父亲过于严格，缺乏关心，举了个例子，有一次2800个人一起考试，学生考了第七名，父亲仍然不够满意。给了他很大的压力。现在父亲不会那么冷酷，但是他认为为时已晚。感觉家人很陌生。\n8.对自己的母亲和妹妹有依恋，不忍心让她们担心，家人不知道自己自杀的事情。\n9.现在所在英国伯恩茅斯的媒体交流学院，只有7个人，自己很喜欢这个学院，也很喜欢这个专业。\n10.不想回国，认为没有发展，且电子科大不适合他，想学有所成再回来。\n11.在英国每周伙食费20磅一周，房子380磅每月，水电网20磅每月，学费一万三千五磅一学年。\n12.我和他加了微信，和他约定好，每周三通电话聊天，他很开心，我还回忆了第一次见到他的场景，他很惊讶我竟然还记得。\n13.感觉学生还是有求生欲望，他不排斥他人的帮助，当我表达了关心，学生明显健谈了许多，且在我回忆了第一次见到他的场景，很明显能听出来，他很开心。\n14.学生对未来有期盼，对家庭有牵挂。',NULL),(218,2014220902021,'家长联系记录表','2018-01-17','办公室','魏娟','张诗晗','','电话','在今天之前和学生母亲通过电话。内容如下：\n1.父母知道学生的抑郁问题。很关心，母亲在自学心理方面的专业知识。\n2.父母感谢学校的关心。\n3.父母关注学校对其学业的处理情况。\n4.父母回电话，嘱咐我，不要让其他人知道学生抑郁的问题，防止对其名誉造成影响。',''),(219,2014220902021,'家长联系记录表','2018-01-17','办公室','魏娟','张诗晗','','电话','多次打学生家长的电话。打不通。',''),(220,2016220401010,'家长联系记录表','2018-01-17','办公室','王猛','戴瑞婷',NULL,'电话','考试结束联系家长了解该生是否回家。该家长表示该生下午就回家了。你查到该生两门课的成绩，都没有通过，担心该生是否本学期能够拿到十个学分，告知家长，该生的情况，该生家长表示会积极配合监督好好学习，争取补考通过。',''),(221,2016220401010,'周联系简易记录表','2018-01-17','办公室','','洪磊','','电话','考试结束，了解该生考试的情况。该生表示考试都没有把握，并且平时成绩和实验成绩都很低，了解了，补考是否要算平时成绩和实验成绩，告知补考的情况，并告知他目前的学分情况，本学期需要至少取得十个学分才能够不面临退学。该生态度良好，表示会认真复习补考，并且下学期一定去上课，参加实验，避免再产生此种情况。',''),(223,2016220502030,'周联系简易记录表','2018-01-17','','','齐翔','','电话','打电话问苏小龙他的计划书有没有写好，实际上是为了试探下他的状态。他人在寝室，他妈妈不让他上网，他就在寝室里看别人打游戏的直播。我问他计划写好了没有，他支支吾吾不说话，我问他你是不是不知道该如何下笔。他说是。我说很简单，你先按照学分清理标准，看看自己下学期至少拿到多少个学分才能超过试读后学分。然后这些学分需要过哪些课才能得到。这些课程你准备如何过他们。我让他22号放假之前交给我。他说好的。',''),(224,2016220502030,'家长联系记录表','2018-01-18','','','齐翔','','电话','苏小龙妈妈打电话来问我学校心理中心的老师咨询是不是免费的。我说是的。她说苏小龙不愿意过去，问我能不能把心理中心老师的电话给她。她有时候问问心理中心的老师有没有什么对策之类的。我说我待会儿十点多的时候问下心理中心的老师。',''),(225,2016220502030,'家长联系记录表','2018-01-16','','','齐翔','','电话','苏小龙妈妈晚上给我打电话，听得出来情绪有点激动。她先说了一大段话，大致意思就是他们把孩子交到了学校。结果孩子现在变成了这个样子，是因为学校没有好好约束他。她还问我学校有没有什么强硬一点的措施或者制度，能够吓唬一下苏小龙，比如给个警告处分之类的。我说首先从法律上来说，苏小龙已经是18岁的成人了，有完全的民事权利，所以学校是没有办法限制他的人身自由的，这是违法的。其次，学校是有制度的，基本上现代大学都是采用的学分制，如果学生累计不到规定学分就会被降级或者退学，而且学生手册上有规定。如果出勤率不达标，也是无法参加考试的。我说苏小龙妈妈，我非常理解你现在的心情。但是苏小龙的事情是长年累积的结果，不是一朝一夕能够解决的。首先，我给苏小龙妈妈分析了一下苏小龙性格的成因，我说我分析的可能不太准确。我说第一、苏小龙从小就背井离乡去别的省事读书，所以他的朋友都分散在全国各地，回到家肯定没有朋友，小时候的玩伴也没有谈资。小龙妈妈说对。我继续说：而且他初中和高中又隔得很远，所以初中交的朋友高中就联系不到了，渐渐地他就会觉得交朋友是一件付出和回报不成正比的事情。第二、爸爸在家里话语权比较大，有时候可能行为上、或者言语上一些不当的方式，引起了苏小龙的反感。所以苏小龙就渐渐地不愿意说话。表面上看就会觉得这个孩子爱打游戏，不爱说话，性格内向。我说青少年这个阶段非常渴望得到别人的认同，但是对于苏小龙来说，没有这个宣泄情绪的出口，现在他唯一的出口就是上网。所以体现出来就是好像他只是“网瘾”。',''),(226,2016220502030,'家长联系记录表','2018-01-16','','','齐翔','','电话','（受系统字数限制，接上条）我们要从根上解决这个事情，就是要帮他多找几个“出口”。我觉得让他有朋友，就是一个“出口”。我说我今天买东西送到他寝室，不是为了说教，也不是担心他吃不饱，我只是为了拉近和他的距离。我说只有当他认为对方理解他了，他才能和对方谈话，谈心里话。所以家长在给苏小龙做工作的时候，一定要让他感觉你们能够理解他。后来他妈妈还说，苏小龙以前小学的时候还给一个女生写过情书，后来初中、大学都在一个学校。但是后来也没怎么联系了。还有一件事情就是苏小龙上大一的时候曾跟他妈妈说过，他觉得他爸爸妈妈生了二胎就是不重视他了，这一点也是他妈妈吗以前从来就不知道的。他妈妈说他很重视他的大儿子，家里都是种地的农民，挣钱不容易，如果不爱他，会愿意花那么多钱把他弄到乌鲁木齐的初中去吗？而且苏小龙在广东上内高班的时候，国家是包了食宿的，但是苏小龙妈妈还是每年给他一万块钱零花钱，就是从那个时候慢慢养成了泡网吧打游戏的习惯。',''),(227,2016220105027,'面谈记录表','2018-01-17','教室','','齐翔','','','苏小龙赶来开他们班的假期前安全主题班会，但是看错了时间，把3:15看成了3:50，所以没有赶上。但是我还在现场，所以跟他聊了几句。他的精神状态已经比之前好很多。我叮嘱了他寒假期间要注意安全。他说他18号就和妈妈一起去安徽。最后表示多谢老师的关心。',NULL),(228,2014220402032,'家长联系记录表','2018-01-13','学院办公室','','洪磊','','','之前一直是电话和微信与母亲沟通，第一次见面和父母交流，整个过程一直是母亲在讲述江宸从小到大的成长经历：\n1、3岁多的美术课，被老师请起来发言，突然失语，过后的三天都不会讲话了。2、去学游泳，一直发抖，游泳教练感觉孩子过于紧张，从而终止。3、不太喜欢和小朋友玩耍，喜欢躲在邻居家看书，直到现在在寝室也有蹲在桌子下看书的习惯。4、小学5年级和父母去海南旅游，由于好奇去天涯海角大石头背后看海浪，母亲因为找不到孩子着急，当孩子看够了从石头背后走出来，着急的母亲在公众场合打了孩子，从此孩子不再喜欢和父母旅游。',''),(229,2014220402032,'面谈记录表','2018-01-18','网络','','洪磊','','','通过qq和江宸沟通实习事宜，他说在忙综合设计的事情，简历晚上可以发给我，还是愿意实习',NULL),(230,2014220902021,'家长联系记录表','2018-01-18','办公室','魏娟','张诗晗','','电话','继续打家里的电话，不通。通过百度查询学生父亲的工作单位电话，得知已经离职，苦苦相求工作人员，换来工作人员答应帮我联系一下他的父亲。\n和学生父亲联系上后，告知其学生现在的情况：1.重度抑郁是否清楚，回答模糊，后说清楚。2.告知他学生曾尝试自杀是否清楚，回答不清楚，告知他学生睡眠和饮食上的困难 3.把学生说的关于家庭关系的影响告诉了他，请他注意关心学生。4.给他提建议，利用过年的契机，到英国去团圆，带着学生散心并感受家庭温暖。5.告知家长我和学生约定好每周三会打电话，会把通话内容告知家长。\n后学生母亲接过电话，反应较为激烈，我多次强调不要让学生知道我在联系家里，否则对其康复不利，家长多次询问学校是否可以强势把学生送回国。告知她学校心理中心电话。',''),(231,2014220902021,'研讨及总结记录','2018-01-18','办公室',NULL,'张诗晗','李谷静',NULL,'确定管理责任。 了解英国的程序。',''),(232,2014220902021,'研讨及总结记录','2018-01-18','办公室',NULL,'张诗晗','吴祖峰 朱国斌',NULL,'1.明确是学校还是学院的项目，找到签订的协议。\n2.联系匡平老师（正在英国伯恩茅斯），看一下是否能提供帮助。\n',''),(233,2014220902021,'家长联系记录表','2018-01-18','办公室','魏娟','张诗晗','','电话','1.家长希望我能够和学生保持联系。\n2.家长希望我能做通学生的工作-让家人到英国去看望他。\n',''),(234,2014220902021,'研讨及总结记录','2018-01-18','微信',NULL,'张诗晗','梁一天',NULL,'梁一天将学院与英国学校签订的协议发了图片给我，并要求我把学生的情况告诉她。',''),(235,2016220101002,'周联系简易记录表','2018-01-18','','','','','','',''),(236,2016220502030,'家长联系记录表','2018-01-18','','','齐翔','','电话','中午谈过话之后，苏小龙妈妈又跟苏小龙谈了。下午的时候给我打电话，说苏小龙答应和她明天一起回新疆。我问是怎么做通工作的。她说苏小龙爸爸给苏小龙打电话，说家里装上了网，让他回来，不会管他上完了。苏小龙答应回去，小龙爸爸让他今天在成都玩尽兴，明天就和妈妈一起回去。',''),(237,2016220502030,'家长联系记录表','2018-01-19','主楼楼下喷泉','','齐翔','','面谈','苏小龙妈妈来找我拿苏小龙的火车票优惠卡。我和苏小龙妈妈说你们安全到家之后给我们发个短信，大过年的好让我们放心。小龙妈妈说一到家就给我发短信。',''),(238,2016220105027,'家长联系记录表','2018-01-18','','','齐翔','','电话','打电话给文梵妈妈，问文梵什么时候回家，文梵妈妈说文梵昨天晚上就已经收拾好东西，到酒店和她一起住了，今天下午3点的动车到重庆。我说家长你们到了重庆之后给我发个短信吧，好让我们放心。她说好的。我又提醒了家长，寒假的时候注意监督文梵复习。文梵妈妈说她一定会监督孩子复习的，同时表达对老师的感谢。',''),(239,2016220105027,'周联系简易记录表','2018-01-18','','','齐翔','','QQ','文梵在QQ上和我说他已经到了重庆',''),(244,2014220902021,'研讨及总结记录','2018-01-19','办公室',NULL,'张诗晗','匡平',NULL,'匡老师在2016年11月赴英国伯恩茅斯学习，2017年11月回来，在英国期间，与颜铭有接触，并曾住在一起，匡老师还带着颜铭去动物园等地方。匡老师反馈：学业上，当时颜铭挂了一科，匡老师还在嘱咐他好好学习，在身心健康上，感觉学生孤僻，不会寻求帮助，与社会联系少，有想法，有个性，留长发，但能够帮助他人。\n匡老师说英方学生少，老师多，对其学业管理的比较细致，但身心健康这块无法像国内一样管理。\n我与匡老师说明了学生的情况，主要在学业问题和心理问题上。匡老师表示很震惊，因为在英国期间完全看不出来，且2017年6月颜铭尝试自杀后，入住匡老师家里，匡老师都没有看出来他的问题。\n现在匡老师表示会与英国老师联系，主要关注其学业问题，看下英方有无其他帮助。\n并建议尽量处理好学生的学业问题，尽快回国。',''),(245,2014220902021,'研讨及总结记录','2018-01-19','办公室',NULL,'张诗晗','吴祖峰',NULL,'将颜铭的情况说明报备给学工部。\n内容如下：\n颜铭，信软学院2014级数字动漫专业方向学生，学号2014220902021，自2016年9月参加了英国伯恩茅斯大学本科生2+2项目，所在媒体交流学院，现学生在英国。\n学生家住广东省东莞市石碣镇，父亲是医生，母亲无工作，家里还有一位正在读高中的妹妹。学生认为其父亲对自己的要求过于严格，家人的关注点始终在学习上，对其身心健康关心极少，自初中开始，学生开始封闭感情，“感觉家人很陌生”，现在其父亲的态度较温和，但学生认为为时已晚。\n学生在电子科大读书期间，性格较为孤僻，独来独往，但能够正常配合老师和班级的工作，对动画方面有较为浓厚的兴趣。截至目前，学生并未参加实习实训，学分不够不能按时毕业。\n在英期间，学生被诊断为重度抑郁，已经开始服药治疗，但是病情反复，在2018年1月17日辅导员与他联系中得知，英国医生已经让其加倍服药，若效果不好则需换药。\n颜铭同学在十余天前已经尝试自杀，采用绳子勒颈部的办法，后想到可能会给英国房东带来麻烦，并想到了家里的妈妈和妹妹便放弃。在2018年1月18日与其家长电话沟通5次后，家长说其在2017年6月份已经尝试过用刀片自杀过一次。\n学生在2018年1月16日晚吃了一餐，在之前的一天半滴米未进，并整夜失眠。\n辅导员与学生沟通时，学生表示自己抑郁的原因在于家庭缺乏温暖与个人要求完美。\n现在在英国重修课程，学生自述英国学校不会开除生病的同学，故而学生在英国还在继续学习。\n学生与其他4名英国同学一起租房子居住，整个专业方向只有7个学生，基本无朋友，与他人接触非常少，无人陪伴。学生对回国较为抵触。\n学生每月伙食费160磅，房租每月380磅，水电网费每月20磅，学费每学年13500磅。\n辅导员张诗晗与学生约定每周三下午与学生通电话，做好陪伴工作。\n辅导员与家长在2017年下半年与家长沟通时，家长并未说明学生已经有过自杀行为。现在其家长在到英国陪伴方面存在困难，家长说学生拒绝探望。家长希望学校能够让学生尽快回国，做通学生的工作，保持联系。\n后续工作：与家长、学生保持联系。与英方取得联系，争取获得支持，争取英国合作方对学生给予关注。建议学生家长赴应陪同并做治疗，对于家长说学生的抵触心理，学院将给予协助，与学生沟通。',''),(246,2014220105010,'面谈记录表','2018-01-19','办公室','','张诗晗','','','给学生发QQ ，秒回。\n问其是否回校住宿，得到了肯定的回复。问其何时回家，说暂时没定。告诉他还是要珍惜寒假的时光，回家陪伴家人，得到了肯定的回复。\n但之后给他打了两个电话，就没有接。',NULL),(247,2014220105010,'家长联系记录表','2018-01-19','办公室','魏娟','张诗晗','','QQ','家长问学生是否回校住宿，我将与学生的对话截图发给家长。',''),(249,2014220902021,'研讨及总结记录','2018-01-19','办公室',NULL,'张诗晗','李谷静 梁一天 吴祖峰',NULL,'接心理中心李谷静老师的建议，在与副书记吴祖峰请示后，与学院国际事务中心梁一天一起联系中国驻英国大使馆和教育部留学中心。\n我在与教育部留学中心联系后，对方表示学生不属于公派留学，没办法提供帮助，建议我们联系中国驻英国大使馆。\n梁一天表示已经也遇到过类似的情况，相关部门认为弄到教育部和大使馆去了，并不是很高兴，所以要在和学校沟通后再确定。但是暂时学校国际办没人接电话。\n我将这两种情况与学工部孙东通报，并告知了心理中心。\n学工部孙东的意见是：一定要找到签订的协议，确定学生的学籍在哪里，明确职责的边界。\n分清楚我们是协助。',''),(250,2014220902021,'研讨及总结记录','2018-01-19','办公室',NULL,'张诗晗','吴祖峰',NULL,'1.在下一次联系的时候，要到学生的学习情况，在开学的时候协助学分置换。\n2.做好协助的工作。\n3.请梁一天确定一下学籍的问题。',''),(251,2016220101002,'研讨及总结记录','2018-01-21','','','','',NULL,'','');
